(@max_anr_id,3,'Risks analysis','1.0',1,'Confidential','CASES Advisor','CEO MyPrint','<div><!--block-->To build its security plan, MyPrint commissioned CASES to help it carry out its risk analysis. This study is the starting point for identifying robust measures adapted to its mode of operation.&nbsp;<br><br>This analysis began on 10/09/2018 and ended on 14/03/2019.<br><br>For this risk analysis, it was decided that a department view is the most functional and easily understandable.<br><br>The risk analysis includes 2 departments identified below:<br><br></div><ul><li><!--block-->Printing department</li><li><!--block-->Computer graphics department</li></ul><div><!--block--><br>and GDPR compliance in the processing of personal data for the card design service.<br><br>The results of the collection of information, encodings and various evaluations are processed in the MONARC tool. All this information is also available following this document.<br><br>The risk analysis raised 143 risks related to information security (see section 4.2.1) and 62 operational risks related in particular to the processing of personal data (see section 4.2.2).</div>','Admin Admin','2020-05-15 16:06:41',NULL,NULL),
