INSERT INTO `questions` (`anr_id`, `label1`, `label2`, `label3`, `label4`, `position`, `type`, `multichoice`, `response`, `creator`, `created_at`, `updater`, `updated_at`, `mode`)
VALUES
(@max_anr_id,'Quelle est la raison d\'être de votre structure ?','What is the purpose of your organization?','Was ist der Zweck Ihrer Organisation?','Wat is de bestaansreden van uw structuur?',1,1,0,'Printing is the core business.\nThere are also some computer graphics activities that represent about 5% of the turnover.','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0),
(@max_anr_id,'Quelle est l\'évolution de votre activité de dernières années ?','What is the progression of your business in recent years?','Welchen Verlauf hat Ihr Unternehmen in den letzten Jahren geschäftlich genommen?','Hoe is uw activiteit de afgelopen jaren geëvolueerd?',2,1,0,'Activity is rather stable, even slightly decreasing. The banking sector market is a great opportunity for development.','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0),
(@max_anr_id,'Quelle est l\'évolution du contexte externe (concurrence, évolution marché, lois, etc.) ?','What is the evolution of the external environment (competition, market evolution, laws, etc.)?','Wie haben sich die externen Kriterien verändert (Wettbewerb, Marktentwicklung, rechtliche Rahmenbedingungen usw.)?','Hoe is de externe context geëvolueerd (concurrentie, markt, wetgeving enz.) ?',3,1,0,'Competition is in the same situation. The possibilities for market development are limited. \nInternational competition is becoming more and more pressing.','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0),
(@max_anr_id,'Quels pourraient être les motifs d\'attaque contre votre structure ?','What might be the attack reasons on your structure?','Welche Angriffsflächen könnte Ihre Struktur bieten?','Wat zouden motieven kunnen zijn om uw structuur aan te vallen?',4,2,1,'[93,94,96]','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0),
(@max_anr_id,'Quels sont vos processus métiers les plus importants ?','What are your most important business processes?','Nennen Sie Ihre wichtigsten Geschäftsprozesse:','Welke zijn uw belangrijkste vakprocessen?',5,1,0,'The printing departement\nThe computer graphics department','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0),
(@max_anr_id,'Quel est l\'actif ayant le plus de valeur dans votre structure ?','What is the most valuable asset in your organization?','Nennen Sie die wichtigsten Vermögenswerte in Ihrer Organisation:','Welk actief heeft de hoogste waarde binnen uw structuur?',6,1,0,'Printing machines.  \nCustomer information.','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0),
(@max_anr_id,'Pour votre activité et vos données quel est le critère le plus important ?','What is the most important criterion for your business and data, in terms of confidentiality, integrity and availability?','Welches ist das wichtigste Kriterium für Ihr Unternehmen und Ihre Daten in Bezug auf Vertraulichkeit, Integrität und Verfügbarkeit?','Wat is het belangrijkste criterium voor uw activiteit en uw gegevens?',7,1,0,'Availability is a predominant factor. The printing of two weeklies imposes strict time constraints.\nThe information is generally public, but must be honest.\nIn the future, the management of confidential data in the banking sector will impose confidentiality constraints.','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0),
(@max_anr_id,'Votre activité est-elle contrainte au respect de lois, normes, règlements spécifiques (par ex. santé/médical - loi relative à la protection des informations sur le patient) ?','Your activity must comply with laws, standards, specific regulations (eg Health / Medical right for the protection of patient information)?','Müssen Sie bei Ihren Aktivitäten auf die Einhaltung von gesetzlichen Vorgaben, Normen, besonderen Bestimmungen usw. achten (z. B. im Gesundheitswesen Bestimmungen zum Schutz von Patientendaten)?','Is uw activiteit onderworpen aan wetten, normen, specifieke voorschriften (bv. gezondheid/medisch - wet inzake de bescherming van patiëntengegevens)?',8,1,0,'No, not at the moment.','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0),
(@max_anr_id,'Quelle est la menace la plus importante pour votre activité ?','What is the most important threat to your business?','Was ist die größte Bedrohung für Ihre geschäftlichen Aktivitäten?','Wat vormt de grootste bedreiging voor uw activiteit?',9,1,0,'The stopping of presses or production in general. Failure of machines.\nFire in the paper stock.','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0),
(@max_anr_id,'Quelles sont vos plus grandes craintes (ce qui pourrait anéantir votre activité)?','What are your biggest fears (Those that could destroy your business)?','Was sind Ihre größten Befürchtungen (solche, die Ihr Unternehmen zerstören könnten)?','Wat zijn uw grootste angsten (voor dingen die uw activiteit zouden kunnen vernietigen)?',10,1,0,'Loss of image or customer trust.','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0),
(@max_anr_id,'Avez-vous déjà connu un sinistre ou une attaque informatique ?','Have you ever know a disaster or cyber-attack?','Haben Sie jemals einen Katastrophenfall oder einen Cyberangriff erlebt?','Hebt u al ooit een informaticaramp of -aanval meegemaakt?',11,1,0,'No. No more than one day of unavailability of the information system.','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0),
(@max_anr_id,'Vos concurrents ont-ils déjà connu un sinistre ou attaque informatique ?','Have your competitors ever experienced a disaster or cyber-attack?','Haben Ihre Konkurrenten jemals einen Katastrophenfall oder einen Cyberangriff erlebt?','Hebben uw concurrenten al ooit een informaticaramp of -aanval meegemaakt?',12,1,0,'No knowledge.','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0),
(@max_anr_id,'Votre environnement géographique vous prédispose-t-il à un risque de type (inondation, feu, tempête, fortes neiges...)','Is your geographic environment susceptible to flooding, fire, storm, heavy snow?','Gibt es bei Ihnen aufgrund der geografischen Lage ein erhöhtes Risiko für Hochwasser, Feuer, Sturm oder starke Schneefälle?','Vertoont uw bedrijf een geografische ligging die het vatbaar maakt voor bepaalde risico’s (overstroming, brand, storm, zware sneeuwval ...)?',13,1,0,'No, no specific risks.','Admin Admin','2020-05-17 20:15:23','Admin Admin','2020-05-17 20:15:23',0);
