INSERT INTO `scales_comments` (`anr_id`, `scale_id`, `scale_type_impact_id`, `val`, `comment1`, `comment2`, `comment3`, `comment4`, `creator`, `created_at`, `updater`, `updated_at`)
VALUES
(@max_anr_id,@max_scale_id + 1,NULL,0,'Pas de vulnérabilité.','No vulnerabilities.','Keine Sicherheitsrisiken','Geen kwetsbaarheid','Admin Admin','2020-05-17 20:22:59',NULL,NULL),
(@max_anr_id,@max_scale_id + 1,NULL,1,'Vulnérabilité très faible : Des mesures efficaces sont en place, leurs efficacités sont contrôlées.\nTrès bonne maturité : Les bonnes pratiques sont implémentées et périodiquement vérifiées.','Very weak vulnerability: Some efficient measures have been already taken, and their effectiveness is controlled.\nVery high maturity: Good practices are implemented and frequently verified.','Sehr geringes Sicherheitsrisiko: Einige effiziente Maßnahmen wurden bereits getroffen und ihre Effizienz wird kontrolliert.\nSehr hoher Reifegrad: Bewährte Verfahrensweisen sind implementiert und werden häufig überprüft.','Zeer geringe kwetsbaarheid: er werden doeltreffende maatregelen genomen. De goede praktijken werden geïmplementeerd en worden regelmatig geverifieerd.','Admin Admin','2020-05-17 20:22:59',NULL,NULL),
(@max_anr_id,@max_scale_id + 1,NULL,2,'Vulnérabilité faible : Des mesures efficaces sont en place.\nBonne maturité : Les bonnes pratiques sont implémentées.','Weak vulnerability: Some efficient measures have been already taken.\nHigh maturity: Good practices are implemented.','Geringes Sicherheitsrisiko: Einige effiziente Maßnahmen wurden bereits getroffen.\nHoher Reifegrad: Bewährte Verfahrensweisen sind implementiert.','Geringe kwetsbaarheid: er werden doeltreffende maatregelen genomen. De goede praktijken werden geïmplementeerd.','Admin Admin','2020-05-17 20:23:00',NULL,NULL),
(@max_anr_id,@max_scale_id + 2,NULL,0,'Impossible','Impossible','Unmöglich','Onmogelijk','Admin Admin','2020-05-17 20:23:00',NULL,NULL),
(@max_anr_id,@max_scale_id + 2,NULL,1,'Très improbable : jamais arrivé, nécessite d\'un haut niveau d\'expertise, ou très coûteux à mettre en œuvre.','Very unlikely: never happened, requires a high level of expert knowledge, or it is very expensive to execute.','Sehr unwahrscheinlich: nie aufgetreten, erfordert ein hohes Niveau an Fachwissen oder ist kostspielig bei der Ausführung','Zeer onwaarschijnlijk: nooit voorgekomen, vereist een hoog expertiseniveau, of zeer kostelijk om te implementeren.','Admin Admin','2020-05-17 20:23:00',NULL,NULL),
(@max_anr_id,@max_scale_id + 2,NULL,2,'Improbable : Peut être déjà survenu, phénomène rare ou nécessite d\'un bon niveau d\'expertise ou coûteux à mettre en œuvre.','Unlikely: might have happened, rare phenomenon which requires a good level of expert knowledge, or it is expensive to execute.','Unwahrscheinlich: hätte auftreten können, seltenes Phänomen, das ein gutes Niveau an Fachwissen erfordert oder kostspielig bei der Ausführung ist','Onwaarschijnlijk: kan al ooit zijn voorgekomen, zeldzaam verschijnsel of vereist een goed expertiseniveau of kostelijk om te implementeren.','Admin Admin','2020-05-17 20:23:01',NULL,NULL),
(@max_anr_id,@max_scale_id + 2,NULL,3,'Peut arriver de temps à autre.','Could happen occasionally','Könnte gelegentlich auftreten','Kan nu en dan voorkomen','Admin Admin','2020-05-17 20:23:01',NULL,NULL),
(@max_anr_id,@max_scale_id + 2,NULL,4,'Très probable: facile à mettre en œuvre, pas d\'investissement ou d\'expertise particulière.','Very likely: easy to execute, no mentionable investment or knowledge necessary','Sehr wahrscheinlich: einfach auszuführen, keine nennenswerte Investitionen oder Kenntnisse erforderlich','Zeer waarschijnlijk: gemakkelijk te implementeren, geen investering of specifieke expertise','Admin Admin','2020-05-17 20:23:01',NULL,NULL),
(@max_anr_id,@max_scale_id + 1,NULL,3,'Vulnérabilité normale : Des mesures sont en place, elle peuvent encore être améliorées.\nMaturité moyenne : Les bonnes pratiques sont implémentées sans recherche d\'amélioration.','Average vulnerability: Some measures have been already taken, even though they could be better.\nAverage maturity: Good practices are implemented without searching a better way.','Durchschnittliches Sicherheitsrisiko: Einige Maßnahmen wurden bereits ergriffen, könnten jedoch besser sein.\nDurchschnittlicher Reifegrad: Bewährte Verfahrensweisen sind implementiert ohne Suche nach einem besseren Weg.','Normale kwetsbaarheid: er zijn maatregelen getroffen, en die werken zonder dat er naar verbetering wordt gestreefd.','Admin Admin','2020-05-17 20:23:02',NULL,NULL),
(@max_anr_id,@max_scale_id + 1,NULL,4,'Vulnérabilité élevée : Des mesures sont en place, mais elles sont peu efficaces ou inadaptées.\nMaturité faible : Les bonnes pratiques ne sont pas implémentées, pratiques primaires sans réflexion.','Strong vulnerability: Some measures have been already taken, even though they are ineffective or unadapted.\nLow maturity: Good practices aren’t implemented, but there are some positive reactions without any thoughts.','Hohes Sicherheitsrisiko: Einige Maßnahmen wurden bereits ergriffen, sind jedoch ineffizient oder ungeeignet.\nNiedriger Reifegrad: Bewährte Verfahrensweisen sind nicht implementiert, aber es gibt einige positive unüberlegt Reaktionen.','Hoge kwetsbaarheid: er zijn maatregelen getroffen, maar die zijn niet bijzonder efficiënt of onaangepast.','Admin Admin','2020-05-17 20:23:02',NULL,NULL),
(@max_anr_id,@max_scale_id + 1,NULL,5,'Vulnérabilité très élevée : aucune mesure en place.\nMaturité très faible - Aucune maturité.','Very strong vulnerability: No measures have been implemented.\nVery low maturity or no maturity at all.','Sehr hohes Sicherheitsrisiko: Maßnahmen wurden nicht implementiert.\nSehr niedriger Reifegrad oder völlig fehlender Reifegrad','Zeer hoge kwetsbaarheid: geen maatregelen getroffen.','Admin Admin','2020-05-17 20:23:02',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,1,0,'Impact inexistant.\nLe critère de confidentialité n’est pas important.','Nonexistent impact.\nThe confidentiality criterion is not important.','Ohne Auswirkung\nDas Vertraulichkeitskriterium ist nicht wichtig.','Geen effect. \nHet vertrouwelijkheidscriterium is niet belangrijk.','Admin Admin','2020-05-17 20:23:03',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,1,1,'Impact faible, négligeable\nLa divulgation est défavorable aux intérêts de l’organisation\nExemples :\n- Divulgation d’information interne ne devant pas sortir de l’organisme\n- Note de service\n- Annuaire téléphonique interne','Weak impact, insignificant. \nInformation leaks are negative to the organization’s interests.\nExamples:\n- Internal information leaks which shouldn’t be outside the company.\n- Memorandum\n- Internal phone directory','Schwache Auswirkung, unbedeutend \nInformationslecks sind negativ für die Interessen der Organisation.\nBeispiele:\n- Interne Informationen, die das Unternehmen nicht verlassen sollten, werden preisgegeben.\n- Memos\n- Internes Telefonverzeichnis','Gering effect, verwaarloosbaar \nDe verspreiding is ongunstig voor de belangen van de organisatie\nVoorbeelden: \n- verspreiding van interne informatie die het organisme niet mag verlaten\n- dienstnota\n- intern telefoonboek','Admin Admin','2020-05-17 20:23:03',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,1,2,'Impact moyen, acceptable \nLa divulgation nuit aux intérêts de l’organisation\nExemples :\n- Divulgation d’information moyennement sensible restreinte à un groupe de personnes\n- schéma de réseau interne\n- Documentation ou programme source non critique','Average impact, acceptable.\nInformation leaks harm organization’s interests.\nExamples:\n- Moderately sensitive information leaks which are only for a group of people.\n- Internal networking scheme.\n- Documentation or source code which is non-critical.','Durchschnittliche Auswirkung, annehmbar\nInformationslecks schädigen die Interessen der Organisation.\nBeispiele:\n- Mäßig vertrauliche Information, die nur eine Personengruppe betreffen, werden preisgegeben.\n- Schema für internes Networking\n- Dokumentation ','Gemiddeld effect, aanvaardbaar \nDe verspreiding brengt de belangen van de organisatie schade toe\nVoorbeelden:\n- verspreiding van gemiddeld gevoelige informatie beperkt tot een groep van personen\n- schema van intern netwerk\n- niet kritiek(e) documentatie of bronprogramma','Admin Admin','2020-05-17 20:23:03',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,1,3,'Impact sérieux, difficilement supportable \nLa divulgation nuit gravement aux intérêts de l’organisation\nExemples :\n- Divulgation d’information confidentielle\n- Secret bancaire\n- Données à caractère personnelles sensibles\n- Incidents de sécurité','Strong impact, hardly bearable.\nInformation leaks seriously harm organization’s interest. Example: \n- Confidential information leaks. \n- Bank secrecy\n- Sensitive personal data\n- Security incident','Starke Auswirkung, kaum tragbar\nInformationslecks schädigen die Interessen der Organisation erheblich. Beispiel: \n- Vertrauliche Informationen werden preisgegeben. \n- Bankgeheimnis\n- Vertrauliche personenbezogene Daten\n- Sicherheitsvorfall','Ernstig effect, praktisch ondraaglijk \nDe verspreiding brengt de belangen van de organisatie ernstige schade toe\nVoorbeelden:\n- verspreiding van vertrouwelijke informatie\n- bankgeheim\n- gevoelige persoonlijke gegevens\n- veiligheidsincidenten','Admin Admin','2020-05-17 20:23:04',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,1,4,'Impact très sérieux, insupportable\nLa divulgation nuit de façon quasi insurmontable aux intérêts de l’organisation.\nExemples :\n- Divulgation d’information secrète ou très sensible\n- Information classifiée par la loi (EU, OTAN, nationale, etc.)','Really strong impact, unbearable.\nInformation leaks almost deadly harm organization’s interest.\nExample: \n- Secret or really sensitive information leaks.\n- Classified information by the law (the EU, NATO, national…)','Äußerst starke Auswirkung, untragbar\nInformationslecks ruinieren die Interessen der Organisation beinahe.\nBeispiel: \n- Geheime oder höchst vertrauliche Informationen werden preisgegeben.\n- Geheimsachen nach Gesetz (EU, NATO, National …)','Zeer ernstig effect, ondraaglijk\nDe verspreiding brengt praktisch onherstelbare schade toe aan de belangen van de organisatie.\nVoorbeelden:\n- verspreiding van geheime of zeer gevoelige informatie\n- door de wet geclassificeerde informatie (EU, NAVO, nationaal enz.)','Admin Admin','2020-05-17 20:23:04',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,2,0,'Impact inexistant.\nLe critère d’intégrité n’est pas important.','Nonexistent impact.\nThe integrity criterion is not important.','Ohne Auswirkung\nDas Integritätskriterium ist nicht wichtig.','Geen effect. \nHet integriteitscriterium is niet belangrijk.','Admin Admin','2020-05-17 20:23:04',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,3,0,'Impact inexistant.\nLe critère de disponibilité n’est pas important.','Nonexistent impact.\nThe availability criterion is not important.','Ohne Auswirkung\nDas Verfügbarkeitskriterium ist nicht wichtig.','Geen effect. \nHet beschikbaarheidscriterium is niet belangrijk.','Admin Admin','2020-05-17 20:23:04',NULL,NULL),
