(@max_anr_id,@max_scale_id + 3,2,1,'Impact faible, négligeable\nCorruption facile à rectifier et sans grandes conséquences.\nExemples :\n- Courrier interne, e-mail interne','Weak impact, insignificant. Corruption easy to rectify without any consequences. \nExample: \n- Internal mail or letter.','Schwache Auswirkung, unbedeutend Einfach zu richtende Beschädigung ohne jegliche Folgen \nBeispiel: \n- Interne E-Mail oder Schreiben','Gering effect, verwaarloosbaar\nGemakkelijk te herstellen aantasting zonder grote gevolgen.\nVoorbeelden:\n- interne post, interne e-mail','Admin Admin','2020-05-17 20:23:06',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,3,1,'Impact faible, négligeable\nIndisponibilité gênante, mais pas encore préjudiciable pour les parties prenantes','Weak impact, insignificant. \nUnavailability which is inconvenient, but not really harmful for the stakeholders.','Schwache Auswirkung, unbedeutend \nNichtverfügbarkeit, die umständlich, aber nicht wirklich nachteilig für die Stakeholder ist','Gering effect, verwaarloosbaar\nHinderlijke onbeschikbaarheid, maar nog niet schadelijk voor de ontvangende partijen','Admin Admin','2020-05-17 20:23:07',NULL,NULL),
