(@max_anr_id,@max_scale_id + 3,5,1,'Incident mineur sans impact sur la clientèle.','Minor incidents without any impact on customers.','Kleinere Vorfälle ohne jegliche Auswirkungen für Kunden','Incident van ondergeschikt belang met beheersbaar effect op de clientèle','Admin Admin','2020-05-17 20:23:07',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,6,1,'Très peu de chance qu’il y est condamnation, ou elle sera très légère.\nToute poursuite serait vaine.','Small probability of any sentences, or really slight one. \nAny prosecution should be futile.','Geringe Wahrscheinlichkeit einer Strafe oder nur einer sehr leichten \nJegliche Verfolgung sollte aussichtslos sein.','Zeer kleine kans op een veroordeling, of de veroordeling zal zeer licht zijn. \nIedere vervolging zou vergeefs zijn.','Admin Admin','2020-05-17 20:23:08',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,7,1,'Engage quelques frais négligeables. (+/- 1% CA)','Brings some marginal fees (more or less 1% of the sales revenue).','Führt zu einigen geringfügigen Gebühren (um 1 % der Verkaufserlöse).','Veroorzaakt verwaarloosbare kosten. (+/- 1 % omzet)','Admin Admin','2020-05-17 20:23:08',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,8,1,'Quelques désagréments qui seront surmontés sans difficulté (perte de temps, réitérations de démarches, agacement, énervement, etc.)','Some inconvenience which will be topped without difficulty (Time waste, procedure reiteration, irritation, etc.).','Einige Unannehmlichkeiten, die mühelos überwunden werden (Zeitverschwendung, Verfahrenswiederholung, Irritation usw.)','Enkele onaangenaamheden die men moeiteloos te boven komt (tijdverlies, herhaling van procedures, irritatie, zenuwachtigheid enz.)','Admin Admin','2020-05-17 20:23:08',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,2,2,'Impact moyen, acceptable\nCorruption occasionnant une gêne modérée aux parties prenantes. Le rétablissement est facile.\nExemples :\n- Site Internet informationnel','Average impact, acceptable.\nCorruption which brings an inconvenience to the stakeholders. Recovery is easy.\nExample:\n- Informational web site.','\"Durchschnittliche Auswirkung, annehmbar\nBeschädigung, die zu Unannehmlichkeiten für die Stakeholder führt Wiederherstellung ist einfach.\nBeispiel:\n- Informative Website\"\n','Gemiddeld effect, aanvaardbaar\nAantasting die een matige hinder vormt voor de ontvangende partijen. Eenvoudig te herstellen.\nVoorbeelden:\n- informatiewebsite','Admin Admin','2020-05-17 20:23:08',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,3,2,'Impact moyen, acceptable\nIndisponibilité occasionnant une gêne modérée aux parties prenantes.\nExemples :\n- Délais maximums considérés comme insupportables pas encore atteints','Average impact, acceptable.\nUnavailability which brings an inconvenience to the stakeholders. \nExample:\n- Maximum time periods consider as unbearable are not reached.','Durchschnittliche Auswirkung, annehmbar\nBeschädigung, die zu Unannehmlichkeiten für die Stakeholder führt Wiederherstellung ist einfach.\nBeispiel:\n- Informative Website','Gemiddeld effect, aanvaardbaar\nOnbeschikbaarheid die een matige hinder vormt voor de ontvangende partijen.\nVoorbeelden:\n- als ondraaglijk beschouwde maximumtermijnen nog niet bereikt','Admin Admin','2020-05-17 20:23:09',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,4,2,'Altération passagère de l’image de l’organisme ou de ses représentants.\nCritique occasionnelle dans les médias.','Temporary degradation of the company or staff reputation.\nOccasional media critics','Durchschnittliche Auswirkung, annehmbar\nNichtverfügbarkeit, die zu Unannehmlichkeiten für die Stakeholder führt \nBeispiel:\n- Als untragbar geltende Höchstdauerphasen werden nicht erreicht.','Tijdelijke wijziging van het imago van het organisme of van zijn vertegenwoordigers.\nOccasionele kritiek in de media.','Admin Admin','2020-05-17 20:23:09',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,5,2,'Incident isolé avec impact gérable sur la clientèle.','Isolated incidents with a manageable impact on customers.','Isolierte Vorfälle mit überschaubarer Auswirkung auf Kunden','Geïsoleerd incident met beheersbaar effect op de klanten','Admin Admin','2020-05-17 20:23:09',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,6,2,'Condamnation possible de l’organisme.','Possible sentence for the company.','Vorübergehende Abwertung der Firma oder des Rufs der Belegschaft\nGelegentliche Kritik in den Medien','Mogelijke veroordeling van het organisme','Admin Admin','2020-05-17 20:23:10',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,7,2,'Engage des frais non négligeables. (+/- 5% CA)','Brings some non-marginal fees (more or less 5% of the sales revenue).','Führt zu weniger geringfügigen Kosten (um 5 % der Verkaufserlöse)','Veroorzaakt niet verwaarloosbare kosten. (+/- 5 % omzet)','Admin Admin','2020-05-17 20:23:10',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,8,2,'Désagréments significatifs qui pourront être surmontés malgré quelques difficultés (frais supplémentaires, refus d’accès à des prestations commerciales, peur, incompréhension, stress, affection physique mineure, etc.)','Significative inconvenience which could be topped with some difficulties (Additional costs, denial of access to commercial delivery, fear, misunderstanding, stress, slight physical ailments, etc.).','Erhebliche Unannehmlichkeit, die mit einiger Mühe überwunden werden könnte (Zusatzkosten, Verweigerung des Zugangs zur kommerziellen Auslieferung, Angst, Missverständnis, Stress, geringfügige physische Leiden usw.)','Aanzienlijke onaangenaamheden die men te boven komt ondanks een aantal moeilijkheden (extra kosten, weigering van toegang tot commerciële prestaties, angst, onbegrip, stress, geringe lichamelijke aandoeningen enz.)','Admin Admin','2020-05-17 20:23:10',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,2,3,'Impact sérieux, difficilement supportable\nCorruption occasionnant une gêne considérable aux parties prenantes.\nExemples :\n- Confusion entre parties prenantes','Strong impact, hardly bearable.\nCorruption which brings a considerable inconvenience to the stakeholders. \nExample: \n- Confusion between stakeholders.','Starke Auswirkung, kaum tragbar\nBeschädigung, die zu erheblichen Unannehmlichkeiten für die Stakeholder führt \nBeispiel: \n- Verwirrung unter Stakeholdern','Ernstig effect, praktisch ondraaglijk\nAantasting die een aanzienlijke hinder vormt voor de ontvangende partijen.\nVoorbeelden:\n- Verwarring tussen belanghebbenden.','Admin Admin','2020-05-17 20:23:10',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,3,3,'Impact sérieux, difficilement supportable\nIndisponibilité occasionnant une gêne considérable aux parties prenantes.\nExemples :\n- Atteinte des délais maximums considérés comme insupportables','Strong impact, hardly bearable.\nUnavailability which bring a considerable inconvinience to the stakeholders. \nExample: \n- Maximum time periods consider as unbearable are reached.','Starke Auswirkung, kaum tragbar\nNichtverfügbarkeit, die zu erheblichen Unannehmlichkeiten für die Stakeholder führt \nBeispiel: \n- Als untragbar geltende Höchstdauerphasen werden erreicht.','Ernstig effect, praktisch ondraaglijk\nOnbeschikbaarheid die een aanzienlijke hinder vormt voor de ontvangende partijen.\nVoorbeelden:\n- bereiken van de als ondraaglijk beschouwde maximumtermijnen','Admin Admin','2020-05-17 20:23:11',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,4,3,'Très forte altération de l’image de l’organisme ou de ses représentants.\nCritique sérieuse et répétée dans les médias.','Strong degradation of the company or staff reputation.\nSerious and repeated media critics.','Starke Abwertung der Firma oder des Rufs der Belegschaft\nScharfe und wiederholte Kritik in den Medien','Zeer ernstige aantasting van het imago van het organisme of van zijn vertegenwoordigers.\nErnstige en herhaalde kritiek in de media.','Admin Admin','2020-05-17 20:23:11',NULL,NULL),
