(@max_anr_id,@max_scale_id + 3,7,3,'Engage des frais considérables qui auront de répercussions sur l’organisme. (+/- 10% CA)','Brings some heavy fees which can affect the company (more or less 10% of the sales revenue).','Führt zu einigen hohen Gebühren, welche die Firma beeinträchtigen können (um 10 % der Verkaufserlöse).','Veroorzaakt aanzienlijke kosten die repercussies zouden kunnen hebben op het organisme. (+/- 10 % omzet)','Admin Admin','2020-05-17 20:23:12',NULL,NULL),
