(@max_anr_id,@max_scale_id + 3,2,4,'Impact très sérieux, insupportable\nCorruption non recouvrable débouchant sur une indisponibilité définitive','Really strong impact, unbearable.\nCorruption which can’t be recovered or bring a permanent downtime.','Äußerst starke Auswirkung, untragbar\nBeschädigung , die nicht wiederherstellbar ist oder zur permanenter Downtime führt','Zeer ernstig effect, ondraaglijk\nOnherstelbare aantasting die uitmondt in een definitieve onbeschikbaarheid','Admin Admin','2020-05-17 20:23:13',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,3,4,'Impact très sérieux, insupportable\nIndisponibilité demandant un très gros effort de rétablissement, voire définitif.\nExemples :\n- Large dépassement des délais maximums considérés comme insupportables','Really strong impact, unbearable.\nUnavailability which asks some drastic efforts to recover, or even final.\nExample:\n- Important maximums time periods consider as unbearable.','Äußerst starke Auswirkung, untragbar\nNichtverfügbarkeit, die einige drastische Anstrengungen zur Wiederherstellung erfordert oder sogar endgültig ist\nBeispiel:\n- Substanzielle Höchstdauerphasen gelten als untragbar.','Zeer ernstig effect, ondraaglijk\nOnbeschikbaarheid die een zeer grote of zelfs definitieve herstelinspanning vergt.\nVoorbeelden:\n- ruime overschrijding van de als ondraaglijk beschouwde maximumtermijnen','Admin Admin','2020-05-17 20:23:13',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,4,4,'Mort d’homme.\nAltération définitive de l’image de l’organisme ou de ses représentants.\nCouverture médiatique internationale.','Death of someone.\nDefinitive degradation of the company or staff reputation. \nInternationnal media coverage.','Tod einer Person\nDefinitive Abwertung der Firma oder des Rufs der Belegschaft \nInternationale Berichterstattung','Sterfgeval. \nDefinitieve aantasting van het imago van het organisme of van zijn vertegenwoordigers.\nInternationale mediaberichtgeving.','Admin Admin','2020-05-17 20:23:13',NULL,NULL),
