(@max_anr_id,@max_scale_id + 3,6,4,'Condamnation lourde de l’organisme.','Heavy sentence for the company.','Schwere Strafe für die Firma','Ernstige veroordeling van het organisme.','Admin Admin','2020-05-17 20:23:14',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,7,4,'Engage de frais quasiment insurmontable. (+/- 20% CA)','Brings some deadly fees almost insurmontable (more or less 20% of the sales revenue).','Führt zu einigen ruinösen, fast unüberwindbaren Gebühren (um 20 % der Verkaufserlöse).','Veroorzaakt praktisch niet te dragen kosten. (+/- 20 % omzet)','Admin Admin','2020-05-17 20:23:14',NULL,NULL),
(@max_anr_id,@max_scale_id + 3,8,4,'Conséquences significatives, voire irrémédiables, qui pourraient ne pas être surmontées (péril financier, dettes importantes, impossibilité de travailler, affection psychologique ou physique de longue durée, décès, etc.)','Significative consequences almost irremediable, which can\'t be topped (financial distress, important financial debts, working impossibility, long periods psychological and physiological affection, death, etc.).','Erhebliche,nahezu irreparable Folgen, die nicht überwunden werden können (finanzielle Notlage, hohe Finanzverbindlichkeiten, Arbeitsunfähigkeit, langwierige psychologische und physiologische Erkrankung, Tod usw.)','Aanzienlijke of zelfs onomkeerbare gevolgen, die men niet te boven zou kunnen komen (financieel risico, aanzienlijke schulden, onmogelijkheid om te werken, langdurige geestelijke of lichamelijke aandoening, overlijden enz.)','Admin Admin','2020-05-17 20:23:14',NULL,NULL);
