VALUES
('b402d4e0-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 1,0,'MA11','Erreur d\'utilisation','Error in use','Benutzungsfehler','Gebruiksfout','Personne commettant une erreur de manipulation, de saisie, d\'utilisation de matériels ou logiciels.','A person commits an operating error, input error or utilisation error on hardware or software.','Jemand begeht einen Bedienungs-, Eingabe- oder Benutzungsfehler (Hard- oder Software).\n','Persoon die een fout begaat bij het bedienen of gebruiken van hardware of software.',1,1,1,1,2,'Handling large files before printing can sometimes be a problem.',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d513-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 5,0,'MA15','Dysfonctionnement logiciel','Software malfunction','Fehlerhafter betrieb von softwareprogrammen','Slecht functionerende software','Erreur de conception, erreur d\'installation ou négligence d\'exploitation commise lors de modification provoquant une exécution non-conforme.','Design error, installation error or operating error committed during modification causing incorrect execution.','Ein Konzeptionsfehler, Installationsfehler oder eine Nachlässigkeit bei Durchführung einer Änderung verhindern einen konformen Betrieb.\n','Ontwerpfout, installatiefout of exploitatienalatigheid begaan tijdens een wijziging en resulterend in een niet-conforme uitvoering.',0,1,1,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d523-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 5,0,'MA16','Dysfonctionnement ou panne du matériel','Equipment malfunction or failure','Fehlfunktion oder Ausfallen von Betriebsmittel','Slecht functionerende of defecte hardware','Évènement logique ou physique provoquant des dysfonctionnements ou des pannes d\'un matériel.','Logical or physical event causing hardware malfunctions or failures.','Ein logisches oder physisches Ereignis bewirkt einen fehlerhaften Betrieb des Betriebsmittels.','Logische of fysieke gebeurtenis die een storing of een defect in bepaalde hardware veroorzaakt.',0,1,1,1,0,'Daily maintenance of the presses',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d530-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 1,0,'MD14','Usurpation de droits','Forging of rights','Rechtsanmassung','Toe-eigening van rechten','Personne se faisant passer pour une autre de manière à utiliser ces privilèges d\'accès au système d\'information, désinformer le destinataire, réaliser une fraude…','A person assumes the identity of a different person in order to use his/her access rights to the information system, misinform the recipient, commit a fraud, etc.','Jemand gibt sich als jemand anderes aus, um sich mit dessen Zugriffsprivilegien Zugang zum IT-System zu verschaffen, den Empfänger falsch zu informieren, eine betrügerische Tat auszuführen usw.\n','Persoon die zich voordoet als een ander om gebruik te maken van diens toegangsrechten tot het informatiesysteem, om de ontvanger verkeerde informatie te verstrekken, om fraude te plegen …',1,1,1,1,0,'The buildings are isolated from everything.  Few attractive data (for the moment)',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d557-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 1,0,'MD15','Écoute passive','Eavesdropping','Passives mithören','Passieve afluistering','Personne étant connectée aux équipements ou aux supports de communication ou placée dans le périmètre de couverture d\'émission d\'une communication.','Someone connected to communication equipment or media or located inside the transmission coverage boundaries of a communication.','Jemand zapft Kommunikationsgeräte oder -träger an oder befindet sich im Sendebereich einer Kommunikation.','Persoon die is aangesloten op de uitrustingen of de communicatiedragers of die zich binnen het uitzendgebied van een communicatie bevindt.',1,0,0,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d563-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 3,0,'MD19','Espionnage à distance','Remote spying','Fern-spionage','Spionage op afstand','Actions d’un personnel observables à distance. Observation visuelle avec ou sans moyen optique, par exemple observation d’un utilisateur saisissant un code ou un mot de passe sur un clavier.','Personnel actions observable from a distance. Visual observation with or without optical equipment, for example observation of a user entering a code or password on a keyboard.','Beobachtung aus der Entfernung von Aktionen, die von Mitarbeitern ausgeführt werden. Visuelle Beobachtung ohne optische Mittel, z. B. Beobachtung eines Nutzers, der über Tastatur einen Code oder ein Passwort eingibt.\n','Op afstand observeerbare handelingen van personeel. Visuele observatie met of zonder optische middelen, zoals de observatie van een gebruiker die een code of een wachtwoord invoert op een toetsenbord.',1,0,0,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d56f-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 3,0,'MD21','Piégeage du matériel','Tampering with hardware','Sabotieren der hardware','Ondermijnen van de hardware','Personne ayant accès à un support de communication ou à un équipement pour y déposer un mécanisme d\'interception ou de destruction.','Someone with access to a communication medium or equipment installs an interception or destruction device in it.','Jemand verschafft sich Zugang zu einem Kommunikationsträger oder Gerät, um dort einen Schnüffel- oder Zerstörungsmechanismus zu installieren.\n','Persoon die zich toegang verschaft tot een communicatiedrager of tot een uitrusting om er onderscheppings- of vernietigingssysteem in aan te brengen.',1,1,0,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d579-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 2,0,'MD22','Copie frauduleuse ou utilisation de logiciels contrefaits','Fraudulent copying or use of counterfeit software','Betrügeriches Kopieren oder Nutzung von Raubkopien von Software','Frauduleus kopiëren of gebruiken van nagemaakte software','Personne interne à l\'organisme faisant des copies pirates (également appelées copies serviles) de progiciels ou de logiciels \"maison\".','Someone inside the organisation makes fraudulent copies (also called pirated copies) of package software or in-house software.','Institutionsinterne Person fertigen Piratenkopien (auch sklavische Kopien genannt) von \"hauseigenen\" Software und Programmpaketen an.\n','Tot het organisme behorende persoon maakt illegale kopieën van software of softwarepakketten die eigendom zijn van het organisme.',1,0,1,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d584-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 2,0,'MD23','Altération des données','Corruption of data','Datenmanipulation','Wijziging van de gegevens','Personne accédant aux moyens de communication du système d\'information et altérant la transmission des informations (par interception, insertion, destruction...) ou sollicitant ces accès jusqu\'à trouver un accès autorisé.','Someone gains access to the communication equipment of the information system and corrupts transmission of information (by intercepting, inserting, destroying, etc.) or repeatedly attempts access until successful.','Jemand verschafft sich Zugang zu den Kommunikationsmitteln des IT-Systems und manipuliert die Datenübertragung (durch Abfangen, Einschleusen, Beseitigen) oder erprobt solange die Zugänge, bis er einen autorisierten Zugang gefunden hat.\n','Persoon die zich toegang verschaft tot de communicatiemiddelen van het informatiesysteem en die de overdracht van gegevens wijzigt (door onderschepping, inlassing, vernietiging ...) of een beroep doet op die toegangsmogelijkheden tot hij een geautoriseerde toegang vindt.',0,1,0,1,0,'No value in the data. They are intended to be public.',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d58f-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 1,0,'MD24','Reniement d\'actions','Denial of actions','Verleugnung von aktionen','Ontkenning van handelingen','Une personne ou une entité renie sa participation à un échange avec un tiers ou à la réalisation d\'une opération.','A person or entity denies being involved in an exchange with a third party or carrying out an operation.','Eine Einzelperson oder eine Entität leugnet die Teilnahme an einem Austausch mit einem Dritten oder an der Realisierung einer bestimmten Aktion.','Een persoon of een entiteit ontkent zijn of haar deelname aan een uitwisseling met derden of aan de uitvoering van een handeling.',0,1,0,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d599-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 2,0,'MD26','Traitement illicite des données','Illegal processing of data','Unzulässige verarbeitung von daten','Onrechtmatige verwerking van de gegevens','Personne effectuant un traitement d’information non autorisé par la législation ou un règlement.','A person carries out information processing that is forbidden by the law or a regulation.','Jemand bearbeitet Informationen auf eine Art, die durch gesetzliche Verordnung oder durch Vorschriften untersagt ist.\n','Persoon die een informatieverwerking verricht die niet is toegestaan krachtens de wet of een reglement.',1,1,0,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d5a5-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 3,0,'MD27','Interception de signaux parasites compromettants','Interception of compromising interference signals','Abfangen von kompromittierenden störsignalen','Onderschepping van schadelijke stoorsignalen','Signaux parasites d\'origine électromagnétique émis par les matériels (par conduction sur les câbles d\'alimentation électrique ou les fils de masse ou par rayonnement en espace libre).\nLa capture de ces signaux dépend de la distance à l\'équipement visé ou','Interfering signals from an electromagnetic source emitted by the equipment (by conduction on the electrical power supply cables or earth wires or by radiation in free space).\nCapture of these signals depends on the distance to the targeted equipment or t','Aussendung elektromagnetischer Störsignale (durch Übertragung über elektrische Leitungen oder über Masseleiter oder durch Strahlung im freien Raum). Der Einfang dieser Signale hängt von der Entfernung zum anvisierten Gerät oder von der Möglichkeit ab, sic','Elektromagnetische stoorsignalen uitgezonden door de hardware (door geleiding op de elektrische voedingskabels of de massakabels of door straling in de vrije ruimte).\nDe ontvangst van deze signalen hangt af van de afstand van de beoogde apparatuur of de mogelijkheid om zich aan te sluiten op de bekabeling of op om het even welke andere geleider die in de buurt van de apparatuur loopt (koppelingsverschijnsel).',1,0,0,1,0,'Unlikely in our environment',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d5af-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 3,0,'MD36','Vol ou destruction de supports, de documents ou de matériel','Theft or destruction of media, documents or equipment','Entwenden oder Zerstören von Speichermedien, Dokumenten oder Datenträger','Diefstal of vernieling van dragers, documenten of hardware','Le matériel est accessible par des personnes étrangères en interne ou en externe. Il est possible de le détériorer ou de le voler.','Media, documents or equipment can be accessed by foreigners either internally or externally. It can be damaged or stolen.','Die Datenträger, Dokumente oder Betriebsmittel sind für Fremde, entweder intern oder extern, zugänglich. Sie können zerstört oder gestohlen werden\n','De hardware is toegankelijk voor interne of externe onbevoegde personen. Het is mogelijk hem te vernielen of te stelen.',1,0,1,1,1,'No proven cases.',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:42'),
('b402d5c9-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 3,0,'MDA12','Récupération de supports recyclés ou mis au rebut','Retrieval of recycled or discarded media','Übernahme recycelter oder ausgemusterter datenträger','Recuperatie van gerecycleerde of afgedankte dragers','Récupération de supports électroniques (disques durs, disquettes, cartouches de sauvegarde, clés USB, disquettes ZIP, disques durs amovibles...) ou papier (listing, éditions incomplètes, messages...) destinés au recyclage et contenant des informations réc','Retrieval of electronic media (hard discs, floppy discs, back-up cartridges, USB keys, ZIP discs, removable hard discs, etc.) or paper copies (lists, incomplete print-outs, messages, etc.) intended for recycling and containing retrievable information.','Übernahme von elektronischen Informationsträgern (Festplatten, Disketten, Speicherkassetten, USB-Schlüssel, ZIP-Disketten, externen Festplatten usw.) oder von Papier (Listen, unvollständige Textausgaben, Nachrichten usw.), die zum Recycling bestimmt sind','Recuperatie van elektronische dragers (harde schijven, diskettes, back-uppatronen, USB-sticks, zipdisks, externe harde schijven ...) of papier (listings, onvolledige afdrukken, berichten ...) die bestemd zijn voor recyclage en die recupereerbare gegevens bevatten.',1,0,0,1,3,'Large mass of paper to be disposed of',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d5d5-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 3,0,'MDA13','Infection par un malware','Malware infection','Infektion durch Schadsoftware (Malware)','Infectie met malware','Logiciel non désiré executant des opérations cherchant à nuire à l\'organisme.','Unwanted software that is doing operations seeking to harm the company.','Ungewollte Software, welche durch verschiedenste Operationen versucht dem Unternehmen Schaden zu zufügen\n','Ongewenste software die operaties uitvoert om het organisme te schaden.',1,1,1,1,3,'Already there are cases of \"Ransomware\" on the workstations of operators who receive the files to be printed by email.\nAlso at the level of the accounting department (false invoices)',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d5df-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 5,0,'MDA16','Saturation du système informatique','Saturation of the information system','Überlastung des informationssystems','Verzadiging van het informaticasysteem','Personne ou ressource de type matériel, logiciel ou réseau simulant un besoin de ressource intense en provoquant un parasitage intense et continu de la ressource.','A person or resource of a hardware, software or network type simulating an intense demand on resources by setting up continuous bombardment.','Eine Person oder Ressource einer Hardware, Software oder eines Netzwerk-Typs, die eine intensive Bedarf an einem Betriebsmittel vor und provoziert dadurch eine intensive und dauerhafte Störung des Betriebsmittels.\n','Persoon of middel van het type hardware, software of netwerk die of dat een intense middelenbehoefte simuleert door een intense en continue storing van het middel te veroorzaken.',0,0,1,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d5ea-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 1,0,'MDA17','Abus de droits','Abuse of rights','Rechtsmissbrauch','Misbruik van rechten','Personne possédant des droits privilégiés (administrateur de réseaux, personnel informaticien...) et pouvant modifier les caractéristiques d\'exploitation des ressources.','Someone with special rights (network administration, computer specialists, etc.) modifies the operating characteristics of the resources.','Jemand mit privilegierten Zugriffsrechten (Netzadministrator, Informatiker) kann Betriebsparameter ändern.\n','Persoon die over voorkeursrechten beschikt (netwerkadministrator, informaticapersoneel ...) en die de exploitatiekenmerken van de hulpmiddelen kan wijzigen.',1,1,1,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d5f5-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 3,0,'MDA18','Information sans garantie de l\'origine','Data from untrustworthy sources','Informationen ohne herkunftsgarantie','Informatie zonder herkomstgarantie','Réception et exploitation dans le système d\'information de l\'organisme de données erronées ou de matériels non adaptés provenant de sources extérieures.','Receiving false data or unsuitable equipment from outside sources and using them in the organisation.','Empfang und Nutzung im IT-System der Institution von externen fehlerhaften Daten oder nicht angepassten Betriebsmitteln.','Ontvangst en exploitatie in het informatiesysteem van het organisme van foute gegevens of van niet aangepaste hardware afkomstig van externe bronnen.',0,1,0,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d600-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 3,0,'MDA20','Divulgation d\'information','Disclosure','Verbreitung','Verspreiding van informatie','Personne qui, volontairement ou par négligence, diffuse de l\'information .','Person who voluntarily or negligently disclosure information.','Eine Person, welche bewusst oder unbewusst Informationen verbreitet.\n','Persoon die, vrijwillig of door nalatigheid, informatie verspreidt.',1,0,0,1,1,'Not at present, but will have to be taken into consideration in the future.',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d60a-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 5,0,'MDA25','Atteinte à la maintenabilité du système d\'information','Breach of information system maintainability','Beeinträchtigung der wartbarkeit des informationssystems','Aantasting van de onderhoudbaarheid van het informatiesysteem','Absence de maîtrise du système entraînant toute mise à niveau ou évolution impossible','Lack of expertise in the system making retrofitting and upgrading impossible','Eine fehlende Systembeherrschung macht jegliche Aktualisierung oder Weiterentwicklung unmöglich.','Gebrek aan beheersing van het systeem waardoor iedere upgrade of evolutie onmogelijk wordt',0,0,1,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d615-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 1,0,'MDA28','Atteinte à la disponibilité du personnel','Breach of personnel availability','Beeinträchtigung der personalverfügbarkeit','Aantasting van de beschikbaarheid van het personeel','Absence de personnel qualifié ou habilité pour exécuter les opérations normales.','Absence of qualified or authorised personnel to execute the usual operations','Mangel an qualifiziertem und authorisiertem Personal um den üblichen Operationen aus zu führen','Gebrek aan gekwalificeerd personeel voor het uitvoeren van normale handelingen.',0,0,1,1,3,'The computer scientist is an SPOF',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d620-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 6,0,'MDA29','Destruction de matériel ou de supports','Destruction of equipment or supports','Beschädigung von Ausrüstung oder Datenträger','Vernietiging van hardware of dragers','Evènement provoquant la destruction d’un matériel ou d\'un support.','Event causing destruction of equipment or media.','Ereignis das die Zerstörung eines Betriebsmittels oder Datenträgers zur Folge hat.','Gebeurtenis die de vernietiging van hardware of van een drager veroorzaakt.',0,0,1,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d63d-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 6,0,'ME11','Incendie','Fire','Brand','Brand','Toute situation pouvant facilité l\'embrasement d\'un lieu ou d\'un matériel.','Any situation that could facilitate the conflagration of premises or equipment.','Jede Situation, die Flächenbrände oder den Brand von Material \"fördert\"\n','Iedere situatie die kan leiden tot het vuur vatten van een plaats of een stuk hardware.',0,1,1,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d648-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 6,0,'ME12','Dégâts des eaux','Water damage','Wasserschäden','Waterschade','Situation facilitant l\'accès aux équipements par de l\'eau (crues, fuites, caves, etc.)','Situation facilitating the water hazard on equipment (floods, water leak, cellars, etc.)','Situation, die den Wasserschaden \"fördert\" (überschwämmung, Wasserundichtigkeit, Keller, etc.)\n','Situatie die de blootstelling van apparatuur aan water in de hand kan werken (overstroming, lekken, kelders enz.)',0,1,1,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d653-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 6,0,'ME13','Sinistre majeur','Major accident','Grösserer schadensfall','Schadegeval van de hoogste orde','Tout évènement pouvant affecter physiquement les locaux de manière à les rendre inutilisable.','Any event that can physically destroy the premises','Jedes Ereignis, das in einer physische beschädigung vom Firmengelände oder -Gebäude resultieren kann\n','Iedere gebeurtenis die de lokalen zodanig fysiek kan aantasten dat ze onbruikbaar worden.',0,0,1,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d65d-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 6,0,'ME14','Pollution mécanique (vibrations, poussière, saleté, etc.)','Pollution','Verschmutzung','Mechanische verontreiniging (trillingen, stof, vuil enz.)','Présence de poussières, de vapeurs, de gaz corrosifs ou toxiques, dans l\'air ambiant.','Presence of dust, vapours, corrosive or toxic gases in the ambient air.','Vorhandensein von Staub, Dämpfen, korrosiven oder giftigen Gasen in der Umgebungsluft.\n','Aanwezigheid van stof, damp, bijtende of giftige gassen, in de omgevingslucht.',0,1,1,1,3,'A lot of dust in the printing atelier due to paper',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d668-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 4,0,'ME15','Perte des moyens de télécommunication','Failure of telecommunication equipment','Ausfall der telekommunikationsmittel','Verlies van telecommunicatiemiddelen','Perturbation, arrêt ou mauvais dimensionnement des services de télécommunication (téléphone, accès Internet, réseau Internet).','Disturbance, shutdown or incorrect sizing of telecommunications services (telephone, Internet access, Internet network).','Störung, Stillstand oder schlechte Dimensionierung der Telekommunikationsdienste (Telefon, Internetzugang, Internet-Netz).\n','Verstoring, uitval of verkeerde dimensionering van de telecommunicatiediensten (telefoon, internettoegang, internetnetwerk).',0,0,1,1,1,'Not really important except for internet access',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d673-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 4,0,'ME16','Perte d\'alimentation énergétique','Loss of power supply','Ausfall der energieversorgung','Verlies van energievoorziening','Panne, arrêt ou mauvais dimensionnement de l\'alimentation énergétique des biens provenant soit du service fourni par le fournisseur, soit des dispositifs internes de distribution.','Failure, shutdown or incorrect sizing of the power supply to the assets arising either from the supplier\'s service or from the internal distribution system.','Ausfall, Stillstand oder schlechte Dimensionierung der Energieversorgung der Werte, wobei die Energie entweder vom Versorgungsbetrieb oder durch interne Verteilungsvorrichtungen bereitgestellt wird.\n','Panne, uitval of verkeerde dimensionering van de energievoorziening van de goederen afkomstig van hetzij de door de leverancier geleverde dienst, hetzij interne verdeelsystemen.',0,0,1,1,0,'Measurement already in place, dual power supply including emergency generator set.',-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d67d-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 4,0,'ME17','Défaillance de la climatisation','Failure of air-conditioning','Ausfall der klimatisierungssysteme','Defect van de airconditioning','Panne, arrêt ou insuffisance du service de climatisation peut entraîner, pour les biens nécessitant un refroidissement et une ventilation, leur arrêt, des dysfonctionnements voire des pannes.','Failure, shutdown or inadequacy of the air-conditioning service may cause assets requiring cooling or ventilation to shut down, malfunction or fail completely.','Ein Ausfall, Stillstand oder eine Störung der Klimatisierung  kann bei Werten, die eine Abkühlung und Belüftung benötigen, zu deren Stillstand, Fehlbetrieb oder gar Ausfall führen.\n','Panne, uitval of ontoereikendheid van de airconditioning kan leiden tot de uitval, de slechte werking of het defect van goederen die koeling en ventilatie vereisen.',0,0,1,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43'),
('b402d688-4576-11e9-9173-0800277f0571',@max_anr_id,@max_theme_id + 6,0,'ME18','Sinistre environnemental (Incendie, eau, poussière, saleté, etc.)','Environmental disaster (fire, flood, dust, dirt, etc.)','Umweltkatastrophe (Feuer, Überschwemmung, Staub, Smutz, etc.)','Milieuramp (brand, water, stof, vuil enz.)','Tout évènement environnemental pouvant affecter physiquement les locaux de manière à les rendre inutilisable.','Any event that can physically ruin the premises','Jedes Ereignis, das das Firmengelände oder -Gebäude ruinieren kann.','Iedere milieugebeurtenis die de lokalen zodanig fysiek kan aantasten dat ze onbruikbaar worden.',0,1,1,1,1,NULL,-1,'Admin Admin','2020-05-15 16:05:54','Admin Admin','2020-05-15 16:06:43');
