VALUES
('69fbfdd6-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1','Absence de dispositif de protège écran en cas d\'inactivité','No screen saver when equipment is inactive','Fehlende Bildschirmschutzvorrichtungen bei Nichtbenutzung','Gebrek aan een schermvergrendeling in geval van inactiviteit',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfe01-4591-11e9-9173-0800277f0571',@max_anr_id,0,'10','Possibilité d\'installer des correctifs, mises à jour, patches, hotfixes...','Possibility of installing correction programmes, updates, patches, hotfixes, etc.','Möglichkeit zur Installation von Korrekturmaßnahmen, Updates, Patches, Hotfixes usw.','Mogelijkheid voor het installeren van patches, updates, hotfixes ...',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfe14-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1001','Le principe du moindre privilège n\'est pas appliqué','The principle of least privilege is not applied','Der Least-Privileg-Grundsatz wird nicht angewendet','Het “least privilege”-beginsel wordt niet toegepast','Qui a les droits d\'accès ?\nLes droits sont-ils en rapport avec les fonctions des utilisateurs ?','Who has access rights?\nDo rights correspond to users\' roles?','Wer hat Zugriffsrechte?\nSind die Rechte von den Funktionen der Benutzer abhängig?','Wie heeft toegangsrechten?\nZijn de rechten in overeenstemming met de functies van de gebruikers?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfe22-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1004','Présence de protocole ne disposant pas de fonction d\'authentification','Presence of protocol that has no authentication function','Verwendung eines Protokolls ohne Authentifizierungsfunktion','Aanwezigheid van protocol zonder authenticatiefunctie',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfe48-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1005','Les interfaces sont accessibles à tous','The interfaces can be accessed by everyone','Die Schnittstellen sind allgemein zugänglich','De interfaces zijn voor iedereen toegankelijk',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfe54-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1008','Le protocole ne permet pas l\'identification sûre de l\'émetteur','The protocol does not allow certain identification of the sender','Das Protokoll erlaubt keine eindeutige Identifizierung des Absenders','Het protocol maakt het niet mogelijk de zender met zekerheid te identificeren',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfe5f-4591-11e9-9173-0800277f0571',@max_anr_id,0,'101','Possibilité d\'administrer le système à distance','Possibility of remote system administration','Möglichkeit zur Fern-Systemadministration von jeder beliebigen Arbeitsstation aus','Mogelijkheid om het systeem op afstand te beheren','Le télétravail est-il pratiqué? \nQui a la possibilité d\'administrer le système à distance ? En interne ? En externe ?\nQuel est le moyen technique utilisé ?\nAccès toujours actifs ?\nLes échanges sont-ils chiffrés ?','Is teleworking practised? \nWho can administrate the system remotely? Internally? Externally?\nWhich technical means are used?\nIs access always active?\nAre exchanges encrypted?','Wird Telearbeit praktiziert? \nWer hat die Möglichkeit, das System per Fernzugriff zu verwalten? Intern? Extern?\nWelche Technik wird dafür genutzt?\nZugriff immer aktiv?\nWird der Austausch verschlüsselt?','Wordt er gebruik gemaakt van telewerk? \nWie heeft de mogelijkheid om het systeem op afstand te beheren? Intern? Extern?\nWelk technisch middel wordt daarvoor gebruikt?\nToegangen altijd actief?\nZijn de uitwisselingen gecodeerd?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfe6a-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1010','Le protocole ne permet pas l\'envoi d\'accusé de réception','The protocol does not allow acknowledgement of receipt to be sent','Das Protokoll ermöglicht nicht den Versand einer Empfangsbestätigung','Het protocol maakt de verzending van een ontvangstbewijs niet mogelijk',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfe7a-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1012','Absence de filtrage et de journalisation sur les relais de communication inter-réseaux','No filtering and logging on communication relays between networks','Fehlende Filterung und Protokollierung an den Kommunikationsrelais zwischen den einzelnen Netzen','Gebrek aan filtrering en logging over de relais voor communicatie tussen netwerken',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfe8a-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1013','Les relais n\'identifient ni les sources ni les destinations (ex.: spoofing)','The relays identify neither the sources nor the destinations (example of impact: system vulnerable to spoofing attacks)','Die Relais identifizieren weder die Quellen noch die Ziele (mögliche Auswirkungen: Anfälligkeit des Systems für Spoofing-Angriffe)','De relais identificeren noch de bronnen noch de bestemmingen (bv.: spoofing)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfe99-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1014','Mauvais dimensionnement (ex.: trop de données par rapport à la bande passante maximale)','Incorrect sizing (e.g. too much data for the maximum passband)','Schlechte Dimensionierung (z. B. zu viele Daten bezogen auf die maximale Bandbreite)','Verkeerde dimensionering (bv.: te veel gegevens in verhouding tot de maximale bandbreedte)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfeaa-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1018','Circulation en clair des échanges','Circulating information in clear text','Unverschlüsselter Informationsaustausch','Ongecodeerde circulatie van de uitwisselingen',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfeba-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1019','Le système est connecté à des réseaux externes','The system is connected to external networks','Anschluss des Systems an externe Netzwerk','Het systeem is aangesloten op externe netwerken',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfed1-4591-11e9-9173-0800277f0571',@max_anr_id,0,'102','Utilisation d\'un système d\'exploitation standard pour lequel des attaques logiques ont déjà été réalisées','Use of a standard operating system on which logical attacks have already been carried out','Benutzung eines Standard-Betriebssystems, auf das bereits Softwareangriffe durchgeführt wurden','Gebruik van een standaardbesturingssysteem waarvoor er reeds logische aanvallen werden gerealiseerd',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfedc-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1021','Utilisation d\'une version obsolète du serveur de messagerie','Use of an obsolete version of the messaging server','Verwendung einer veralteten Version des Mailboxservers','Gebruik van een verouderde versie van de e-mailserver',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfee8-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1022','Utilisation de système obsolète','Use of an obsolete system','Verwendung eines veralteten Systems','Gebruik van verouderd systeem',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfef2-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1023','Utilisation de système non standard','Use of a non-standard system','Verwendung eines nicht standardmäßigen Systems','Gebruik van niet-standaardsysteem',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbfefc-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1024','Absence de suivi des procédures d\'installation et de maintenance (cahiers de configuration et de paramétrage)','No monitoring of installation and maintenance procedures (configuration and parameter setting records)','Fehlende Nachkontrolle der Installations- und Wartungsprozeduren (Konfigurations- und Parametrierhefte)','Gebrek aan follow-up van de installatie- en onderhoudsprocedures (configuratie- en parametreringsnotities)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff07-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1025','Absence de moyen de support interne','No internal support tool','Fehlendes internes Unterstützungsmittel','Gebrek aan intern ondersteuningsmiddel',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff11-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1026','Le dispositif utilisé permet un autre usage que celui qui est prévu','The equipment can be used for purposes other than those intended','Die jeweilige Einrichtung kann für andere Zwecke benutzt werden als ursprünglich vorgesehen','Het gebruikte systeem maakt een ander gebruik mogelijk dan het bedoelde gebruik',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff1b-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1027','Absence d\'audit ou de supervision des accès (notamment inventaire des accès avec l\'extérieur de l\'organisme et typologie des flux)','No audit or supervision of accesses (for example inventory of accesses outside the organisation and types of data flow)','Fehlende Auditierung bzw. Überwachung der Zugänge (v. a. Bestandsaufnahme der Zugänge von außen in die Institution und Typologie der Personenströme)','Gebrek aan audit van of toezicht op de toegangen (in het bijzonder inventaris van de toegangen van buiten het organisme en typologie van de stromen)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff25-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1028','Absence de règle d\'accès','No access rules','Fehlende Zugangsvorschriften','Gebrek aan toegangsregels',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff3c-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1029','Le dispositif est connecté à des réseaux externes','The system is connected to external networks','Anschluss der Einrichtung an externe Netzwerke','Het systeem is aangesloten op externe netwerken',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff46-4591-11e9-9173-0800277f0571',@max_anr_id,0,'103','Possibilité d\'administrer le système à distance depuis n\'importe quel poste','Possibility of remote system administration from any station','Möglichkeit zur Fern-Systemadministration von jeder beliebigen Arbeitsstation aus','Mogelijkheid om het systeem op afstand te beheren vanaf om het even welk werkstation',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff51-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1030','Le dispositif est accessible par tous','The system can be accessed by everyone','Die Einrichtung ist allgemein zugänglich','Het systeem is voor iedereen toegankelijk',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff5b-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1031','Aucune vérification de l\'origine n\'est faite avant l\'installation des applicatifs','The origin of applications is not checked before installation','Fehlende Herkunftskontrolle der Anwendungsprogramme vor der Installation','Er vindt geen controle van de herkomst plaats vóór het installeren van de applicaties',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff65-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1032','Le dispositif d\'accès permet le stockage de logiciels','The access system allows software storage','Die Zugangseinrichtung ermöglicht die Speicherung von Software','Het toegangssysteem maakt de opslag van software mogelijk',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff71-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1033','Le dispositif d\'accès permet le téléchargement de logiciels','The access system allows software downloads','Die Zugangseinrichtung ermöglicht das Herunterladen von Software','Het toegangssysteem maakt het downloaden van software mogelijk',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff7b-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1037','Absence de mesure de protection (lecture seule...)','No protection measures (read only, etc.)','Fehlende Schutzmaßnahmen (nur Lesemodus z. B.)','Gebrek aan beveiligingsmaatregelen (alleen tegen lezen ...)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff85-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1038','Absence d\'outil de supervision','No supervision tool','Fehlendes Überwachungstool','Gebrek aan toezichtstool',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbff90-4591-11e9-9173-0800277f0571',@max_anr_id,0,'104','Possibilité d\'effacer, de modifier ou d\'installer de nouveaux programmes','Possibility of deleting, modifying or installing new programmes','Möglichkeit zum Löschen, Ändern oder Installieren neuer Programme','Mogelijkheid om programma’s te wissen of te wijzigen en om nieuwe programma’s te installeren',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbffa6-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1040','Le dispositif d\'accès ne journalise pas les traces issues de son exploitation','The access system does not log tracks of its operation','Die Zugangseinrichtung protokolliert keine betriebsspezifischen Protokolldaten','Het toegangssysteem logt geen sporen van zijn gebruik',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbffb1-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1041','L\'accès au dispositif de traces n\'est pas protégé','Access to the tracking system is not protected','Der Zugriff zur Protokolliereinrichtung ist nicht geschützt','De toegang tot het sporensysteem is niet beveiligd',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbffbb-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1042','Le dispositif est accessible par tous (ex.: dispositif n\'authentifiant pas les postes client ni les utilisateurs)','The system can be accessed by everyone (e.g. does not authenticate client stations or users)','Die Einrichtung ist allgemein zugänglich (z. B. keine Authentifizierung der Client-Stationen oder der Nutzer durch die Einrichtung)','Het systeem is voor iedereen toegankelijk ( bv.: systeem dat noch de clientstations noch de gebruikers legaliseert)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbffc5-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1044','Absence de contrôle d\'accès aux informations stockés dans l\'annuaire','No control of access to information stored in the directory','Fehlende Zugriffskontrolle zu den im Unternehmensverzeichnis gespeicherten Informationen','Gebrek aan een controle van de toegang tot de in het telefoonboek opgeslagen informatie',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbffcf-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1045','Possibilité d\'usurper la fonction de l\'annuaire','Possibility of usurping the directory function','Möglichkeit, sich widerrechtlich Funktion des Unternehmensverzeichnisses anzueignen','Mogelijkheid om inbreuk te maken op de functie van het telefoonboek',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fbffd9-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1046','Le système ne permet pas d\'identifier l\'auteur d\'une modification','The system does not allow the author of a modification to be identified','Das System kann den Autor einer Änderung nicht identifizieren','Het systeem maakt het niet mogelijk de auteur van een wijziging te identificeren',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
