('69fc026e-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1106','Utilisation de liste de diffusion interne accessible à tous','Use of the internal distribution list accessible to everyone','Benutzung interner Verteilungslisten, die allen zugänglich sind','Gebruik van een voor iedereen toegankelijke interne verspreidingslijst',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0278-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1107','Mauvais dimensionnement des espaces de stockage des messages reçus','Incorrect sizing of storage spaces for received messages','Schlechte Dimensionierung der Speicherbereiche für erhaltene Mitteilungen','Verkeerde dimensionering van de opslagruimten voor de ontvangen berichten',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
