('69fc0360-4591-11e9-9173-0800277f0571',@max_anr_id,0,'111','Possibilité de copier facilement les distributions des systèmes d\'exploitation propriétaires','Proprietary operating system distributions can be easily copied','Möglichkeit zur problemlosen Kopie von betriebssytemeigenen Distributionen','Mogelijkheid voor het gemakkelijk kopiëren van de distributies van eigendomsbesturingssystemen',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc036b-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1110','Absence de limitation des tailles des pièces jointes','No limits on the size of attachments','Fehlende Größenbegrenzung der Anhänge','Geen beperking op de omvang van bijlagen',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0376-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1111','Mauvais usage des utilisateurs du service de messagerie (utilisation des boîtes aux lettres comme espace d\'archivage)','Incorrect use of the messaging service (mailboxes used as storage space)','Schlechte Benutzungsgewohnheiten des Nachrichtenübermittlungsdienstes durch die Benutzer (Benutzung der Mailboxen als Archivierbereich)','Verkeerd gebruik door de gebruikers van de e-mailservice (gebruik van mailboxen als archiveringsruimte)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0380-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1112','Incompatibilité logicielle (ex.: effet de bord d\'un logiciel antivirus filtrant les messages...)','Software incompatibility (e.g. side effect of message-filtering anti-virus software, etc.)','Inkompatibilität der Software (z. B. Seiteneffekt eines Antivirenprogramms zur Filterung der Nachrichten)','Software-incompatibiliteit (bv.: neveneffect van een antivirussoftware die de berichten filtert ...)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc038b-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1113','Possibilité que le dispositif soit soumit à des requêtes ou données mal formées (ex.: buffer overflow, déni de service sur serveur SMTP, POP3, IMAP)','Possibility of the system being subjected to badly formed requests and data (e.g. buffer overflow, denial of service on SMTP, POP3, IMAP server)','Möglicherweise wird die Einrichtung mit unkorrekten Anfragen bzw. Daten konfrontiert  (z. B. Buffer overflow, Dienstverweigerung am LDAP-Server, SMTP, POP3, IMAP)','Mogelijkheid dat het systeem wordt blootgesteld aan slecht gevormde query’s of gegevens (bv.: buffer overflow, dos-aanval op SMTP-, POP3-, IMAP-server)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0395-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1117','Le dispositif de messagerie est accessible depuis Internet','The messaging system can be accessed from Internet','Die Einrichtung zur Nachrichtenübermittlung ist über Internet zugänglich','Het e-mailsysteem is toegankelijk via een webbrowser',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc03a0-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1118','Utilisation d\'une version obsolète du serveur de messagerie','Use of an obsolete version of the messaging server','Verwendung einer veralteten Version des Mailboxservers','Gebruik van een verouderde versie van de e-mailserver',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc03aa-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1119','Absence de gestion des privilèges d\'accès aux informations (possibilité d\'altérer des informations publiques...)','No management of information access privileges (possibility of corrupting public data, etc.)','Fehlende Verwaltung der Privilegien für den Zugriff auf Informationen (Möglichkeit der Beeinträchtigung öffentlicher Informationen)','Gebrek aan beheer van informatietoegangsrechten (mogelijkheid om openbare informatie te wijzigen ...)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc03b5-4591-11e9-9173-0800277f0571',@max_anr_id,0,'112','Système d\'exploitation attractif ou \"grand public\"','Tempting or popular operating system','Attraktives Betriebssystem oder Betriebssystem für ein breites Publikum','Aantrekkelijke besturingssysteem of besturingssysteem voor het “grote publiek”',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc03cc-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1120','Le système facilite la divulgation à l\'extérieur d\'informations','The system makes it easy to disclose information to the outside','Das System vereinfacht die Verbreitung von Informationen nach außen','Het systeem vergemakkelijkt de externe verspreiding van informatie',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc03d7-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1121','Le système ne permet pas l\'identification de la personne ayant émis une requête','The system does not allow the person issuing a request to be identified','Das System kann die Person, die eine Anfrage gesendet hat, nicht identifizieren','Het systeem laat niet toe de persoon die een query heeft verzonden te identificeren',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc03e1-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1122','Possibilité d\'implanter des programmes pirates','Pirated programmes can be installed','Möglichkeit zur Installation von Piratenprogrammen','Mogelijkheid om piraatprogramma’s te installeren',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc03ec-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1123','Accès public au portail','Public access to the gateway','Publikumszugang zum Portal','Openbare toegang tot de portal',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc03f6-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1124','Mauvais dimensionnement des ressources (ex.: trop de connexions simultanées)','Incorrect sizing of resources (e.g. too many simultaneous connections)','Schlechte Dimensionierung der Ressourcen (z. B. zu viele gleichzeitige Anschaltungen)','Verkeerde dimensionering van de middelen (bv.: te veel gelijktijdige verbindingen)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0401-4591-11e9-9173-0800277f0571',@max_anr_id,0,'113','Possibilité que les systèmes fonctionnent avec des systèmes d\'exploitation copiés illicitement ou contrefaits','Possibility of the systems operating with illegally copied or counterfeit operating systems','Möglicherweise funktionieren die Systeme mit unzulässig kopierten oder gefälschten Betriebssystemen','Mogelijkheid dat de systemen werken met onrechtmatig gekopieerde of nagemaakte besturingssystemen',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc040b-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1132','Exemplaire unique de documents papier (originaux)','Single copy of paper documents (originals)','Ein einziges Exemplar in Papierform (Original)','Papieren documenten bestaan slechts in één exemplaar (originelen)','La perte des documents serait-elle irréversible ?\nEst-ce que la copie a la valeur d\'un original ?','Would document loss be irreversible?\nDoes a copy have the same value as the original?','Wären die Dokumente bei einem Verlust unwiederbringlich verloren?\nHat die Kopie denselben Wert wie ein Original?','Zou het verlies van documenten onherstelbaar zijn?\nHeeft een kopie dezelfde waarde als een origineel?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0416-4591-11e9-9173-0800277f0571',@max_anr_id,0,'116','Le système d\'exploitation permet d\'accéder à des données (base de données...)','The software allows access to data (content of hard disc, data base, etc.)','Über das Betriebssystem besteht Zugriff auf die Daten (Datenbank u. ä.)','Het besturingssysteem maakt toegang tot gegevens mogelijk (database ...)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0421-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1165','Les utilisateurs ne sont pas sensibilisés à la sécurité de l\'information','Users are not made aware of information security','Die Benutzer sind nicht für das Thema Informationssicherheit sensibilisiert.','De gebruikers worden niet gesensibiliseerd voor informatiebeveiliging','Les utilisateurs ont-ils été sensibilisés à la sécurité de l\'information ?\nDes consignes unitaires ont-elles été fournies par email, consigne interne, circulaire interne ... ?','Are users made aware of information security?\nAre unit instructions provided by email, internal instructions, internal circular, etc.?','Wurden die Benutzer für das Thema Informationssicherheit sensibilisiert?\nWurden für jeden Bereich gesondert Anweisungen per E-Mail, interne Handlungsanweisung, internes Rundschreiben usw. mitgeteilt? ','Werden de gebruikers gesensibiliseerd voor informatiebeveiliging?\nWerden er eenduidige instructies verschaft via e-mail, interne order, interne rondzendbrief ... ?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc04c4-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1166','La gestion des autorisations comporte des failles','Authorisation management is flawed','Das Genehmigungsmanagement weist Mängel auf.','Het beheer van de machtiging vertoont mankementen','Y a-t-il une procédure formelle ?\nQui autorise les accès ?\nLe principe de 4 yeux est-il respecté ?','Is there a formal procedure?\nWho authorises access?\nIs the four-eyes principle followed?','Gibt es ein formelles Verfahren?\nWer genehmigt die Zugriffe?\nWird das Vier-Augen-Prinzip beachtet?','Bestaat er een formele procedure?\nWie machtigt de toegangen?\nWerd het 4-ogenprincipe toegepast?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc04d1-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1167','L\'authentification des utilisateurs n\'est pas assurée','User authentication is not ensured','Die Authentifizierung der Benutzer ist nicht gewährleistet.','Er wordt niet gezorgd voor een authenticatie van de gebruikers','Y a-t-il une politique de mots de passe ?\nBonnes pratiques (longueur, complexité, changement ...) ?\nY a-t-il un compte par personne ?\nY a-t-il des comptes partagés ?','Is there a password policy?\nAre there good practices (length, complexity, change, etc.)?\nIs there one account per person?\nAre there shared accounts?','Gibt es Kennwortrichtlinien?\nBest-Practices (Länge, Komplexität, Änderung usw.)?\nGibt es für jede Person ein Konto?\nGibt es Konten, die von mehreren Benutzern gemeinsam genutzt werden?','Bestaat er een wachtwoordenbeleid?\nGoede praktijken (lengte, complexiteit, wijziging ...) ?\nIs er een account per persoon?\nBestaan er gedeelde accounts?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc04e2-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1168','Le principe de besoin d\'en connaître n\'est pas respecté','The need-to-know principle is not respected','Der Grundsatz, wonach nur Personen Zugang haben, die diesen benötigen, wird nicht beachtet.','Het “need-to-know”-beginsel wordt niet toegepast','Est-ce que toutes les autorisations sont données en respectant ce principe ?','Are all authorisations granted in compliance with this principle?','Werden alle Genehmigungen unter Beachtung dieses Prinzips erteilt?','Worden alle machtigingen verleend rekening houdend met dit beginsel?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc04ed-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1172','Pas d\'accord de services avec les  tiers (internes ou externes)','No SLAs with third parties (internal or external)','Keine Dienstleistungsvereinbarung mit (internen oder externen) Dritten','Geen serviceovereenkomst met derden (intern of extern)','Y a-t-il des accords contractuels formels avec les tiers principaux ?\nExiste-t-il des règles d\'intervention ? Nom de personnes ? Délais ?','Are there formal contractual agreements with the main third parties?\nAre there intervention rules? People\'s names? Timeframes?','Gibt es formelle vertragliche Vereinbarungen mit den wichtigsten Dritten?\nGibt es Vorschriften für Einsätze? Namen der Personen? Fristen?','Bestaan er formele contractuele afspraken met de voornaamste derden?\nBestaan er interventieregels? Naam van personen? Termijnen?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc04f7-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1173','Absence de plan de reprise','No recovery plan','Kein Disaster Recovery-Plan','Gebrek aan een herstelprogramma','Existe-t-il un plan de reprise ?\nEst-il exhaustif sur principales activités ?\nA-t-il été testé ?','Is there a recovery plan?\nDoes it cover all the main activities?\nHas it been tested?','Gibt es einen Disaster Recovery-Plan?\nDeckt dieser die wichtigsten Aktivitäten ab?\nWurde er getestet?','Bestaat er een herstelprogramma?\nIs het exhaustief voor de voornaamste activiteiten?\nWerd het getest?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0501-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1174','Les backups ne sont pas réalisés selon l\'état de l\'art','Backups are not carried out in accordance with the state of the art','Backups werden nicht nach dem neuesten technischen Stand durchgeführt.','De back-ups worden niet uitgevoerd volgens de regels van het vak','Existe-t-il une procédure de backup ?\nEst-elle formelle ?\nEst-elle exhaustive ?\nQuelle est la durée de rétention ?\nDes tests de restaurations sont effectués ?\nExiste-t-il une copie Offline ? Externalisée ?','Is there a backup procedure?\nIs it formal?\nIs it exhaustive?\nHow long is the storage period?\nAre recovery tests performed?\nIs there an offline copy? An outsourced copy?','Gibt es ein Backup-Verfahren?\nHandelt es sich um ein formelles Verfahren?\nIst es umfassend?\nWie lange ist die Aufbewahrungsdauer?\nWerden Wiederherstellungstests durchgeführt?\nGibt es eine Offline-Kopie? Ausgelagert?','Bestaat er een back-upprocedure?\nIs ze formeel?\nIs ze exhaustief?\nWat is de bewaringsduur?\nWorden er restore-tests uitgevoerd?\nBestaat er een offline-kopie? Een uitbestede?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc050b-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1176','Possibilité de télécharger et d\'installer des programmes sans contrôle','Programs can be downloaded and installed without monitoring','Programme können ohne Kontrolle heruntergeladen und installiert werden.','Mogelijkheid om programma’s te downloaden en installeren zonder controle','Consignes d\'installation\nWhitelist\nContrôle de l\'origine','Installation instructions\nWhitelist\nOrigin checks','Installationsanweisungen\nWhitelist\nHerkunftskontrolle','Installatie-instructies\nWhitelist\nHerkomstcontrole',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0515-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1177','Outils ou programmes non adaptés à l\'utilisation ou non ergonomiques','Tools or programs are not adapted for use or are not ergonomic','Tools oder Programme nicht an Nutzungszweck angepasst oder nicht ergonomisch','Tools of programma’s niet aangepast aan het gebruik of niet-ergonomisch','L\'ergonomie du logiciel pose-t-elle des problèmes ?\nEst-il complexe à comprendre ou à utiliser ?\nLe temps de formation ou d\'adaptation est-il long ? \nExiste-t-il des cas d\'erreurs connus ?','Does the software\'s design cause users problems?\nIs it complicated to understand or use?\nDoes training or adaptation take a long time? \nAre there any known errors?','Gibt es Probleme mit der Software-Ergonomie?\nIst sie schwer zu verstehen oder zu benutzen?\nDauert die Einarbeitung und Anleitung lange?\nSind Fehler bekannt?','Zorgt de ergonomie van de software voor problemen?\nIs het complex om te begrijpen of te gebruiken?\nIs de opleidings- of aanpassingstijd lang? \nBestaan er gekende gevallen van fouten?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc051f-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1178','La gestion des mises à jour (patch) comporte des lacunes','Update management (patches) is flawed','Das Update-Management (Patches) weist Lücken auf.','Het beheer van de updates (patches) vertoont lacunes','Existe-t-il une procédure ? Formelle ?\nQuelle est la périodicité d\'application ? \nQui est le responsable ?\nDes tests sont-ils effectués ? Avant ? Après ?','Is there a procedure? Is it formal?\nHow frequently is it implemented? \nWho is in charge?\nAre tests performed? Before? After?','Gibt es ein Verfahren? Formell?\nWie sieht das Anwendungsintervall aus? \nWer ist verantwortlich?\nWerden Tests durchgeführt? Vorher? Nachher?','Bestaat er een procedure? Is ze formeel?\nWat is de toepassingsperiodiciteit? \nWie is verantwoordelijk?\nWorden er tests uitgevoerd? Voor? Na?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0536-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1179','Les locaux ne sont pas sécurisés ou peuvent être compromis par des éléments externes','Premises are not secure or could be compromised by external elements','Die Räumlichkeiten sind nicht gesichert bzw. können von fremden Personen betreten werden.','De lokalen zijn niet beveiligd of kunnen in gevaar worden gebracht door externe elementen','Y a-t-il des possibilités de sinistres environnementaux (eau, crues, feu, poussières, tuyauterie, chaleur excessive...) ?\nDes portes coupe-feu sont-elles installées ?\nExiste-t-il des détecteurs de fumée ? des extincteurs en place ?','Are environmental incidents possible (water, flooding, fire, dust, pipes, excessive heat, etc.)?\nHave fire doors been put in?\nAre there smoke detectors and fire extinguishers?','Besteht die Gefahr von Umweltkatastrophen (Wasser, Hochwasser, Feuer, Staub, Leitungen, starke Wärmeentwicklung usw.)?\nGibt es Brandschutztüren?\nGibt es Brandmelder? Feuerlöscher?','Is er sprake van een risico van milieurampen (water, overstroming, brand, stof, leidingen, te grote hitte ...) ?\nWerden er branddeuren voorzien?\nZijn er rookdetectors en/of brandblusapparaten?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0541-4591-11e9-9173-0800277f0571',@max_anr_id,0,'118','Aucune vérification du système d\'exploitation n\'est faite avant l\'installation','The operating system is not checked before installation','Fehlende Überprüfung des Betriebssystems vor der Installation','Er wordt geen controle uitgevoerd van het besturingssysteem vóór de installatie',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc054b-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1182','Failles dans les périmètres d\'accès physiques','Flaws in the physical access boundaries','Mängel bei der physischen Zugangskontrolle','Zwakke plekken in de fysieke toegangsperimeters','Les accès par des personnes non autorisées peuvent être directs ?\nCombien de barrières existe-t-il ? Alarme ? Accueil de visiteurs ?\nDe quelle qualité ?','Can unauthorised persons gain direct access?\nHow many barriers are there? Is there an alarm? Visitor reception?\nOf what quality?','Haben unbefugte Personen direkten Zugang?\nWie viele Zugangskontrollen gibt es? Alarm? Besucherempfang?\nQualität?','Kunnen onbevoegde personen zich rechtstreeks toegang verschaffen?\nHoeveel barrières bestaan er? Alarm? Bezoekersstartpagina?\nVan welke kwaliteit?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0555-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1183','L\'accès est possible pour des personnes n\'ayant aucun motif de service','Persons without a service reason can gain access','Der Zugang ist Personen möglich, die keinen dienstlichen Grund für das Betreten haben.','Toegang is mogelijk voor personen zonder dienstreden','Des personnes non autorisées peuvent accéder à l\'information sans barrières physiques ?\nAccès facile ? \nLocaux publics ? \nPassage ou couloir à proximité ?','Can unauthorised persons access information without physical barriers?\nIs it easy to access? \nAre the premises public? \nIs there a passage or corridor nearby?','Können unbefugte Personen ohne physische Zugangskontrollen auf die Informationen zugreifen?\nLeichter Zugang? \nÖffentliche Räume? \nDurchgang oder Flur in der Nähe?','Kunnen onbevoegde personen zich toegang verschaffen tot de informatie zonder fysieke barrières?\nGemakkelijke toegang? \nOpenbare plaatsen? \nDoorgang of gang in de nabijheid?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0560-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1184','Utilisation d\'un moyen de communication non sécurisé','Use of an unsecured method of communication','Verwendung eines nicht geschützten Kommunikationsmittels','Gebruik van een onbeveiligd communicatiemiddel','Le moyen de communication est-il chiffré ?\nLe moyen de communication est-il accessible par des tiers ?','Is the method of communication encrypted?\nCould third parties access the method of communication?','Ist das Kommunikationsmedium verschlüsselt?\nIst das Kommunikationsmedium für Dritte zugänglich?','Is het communicatiemiddel gecodeerd?\nIs het communicatiemiddel toegankelijk voor derden?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc056a-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1187','Le poste utilisateur est laissé sans surveillance','The user workstation is not monitored','Der Benutzerarbeitsplatz ist unbeaufsichtigt.','Het gebruikersstation wordt onbewaakt achtergelaten','Fermeture de session\nBlocage d\'écran','Ending a session\nScreen block','Abmeldung von Sitzungen\nBildschirmsperre','Sluiting sessie\nSchermvergrendeling',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0574-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1190','Les supports de backup ne sont pas entreposés dans un endroit adéquat','Backup media are not stored in a suitable place','Die Backup-Datenträger werden nicht an einem geeigneten Ort aufbewahrt.','De back-updragers worden niet op een geschikte plaats ondergebracht','Qui a accès aux supports de backup ?\nLe besoin d\'en connaître est-il respecté ?','Who has access to the backup media?\nIs the need-to-know principle respected?','Wer hat Zugang zu den Backup-Datenträgern?\nBeschränkt auf Personen, die Zugriff haben müssen?','Wie heeft toegang tot de back-updragers?\nWordt het “need-to-know”-beginsel gerespecteerd?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc057e-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1191','La mise au rebut n\'est pas correctement assurée','Disposal is not carried out properly','Die Vernichtung erfolgt nicht vorschriftsgemäß.','Er wordt niet op correcte wijze afgedankt','Existe-t-il une procédure formelle ?\nEst-elle respectée ?\nLa chaine de mise au rebut est-elle correcte ?','Is there a formal procedure?\nIs it followed?\nIs the disposal line correct?','Gibt es ein formelles Verfahren?\nWird dieses eingehalten?\nIst die Entsorgungskette richtig organisiert?','Bestaat er een formele procedure?\nWordt ze gerespecteerd?\nIs de afdankingsketen correct?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0589-4591-11e9-9173-0800277f0571',@max_anr_id,0,'12','Possibilité d\'existence de fonctions cachées introduites en phase de conception et développement','Possible existence of hidden functions introduced during the design and development phase','Möglichkeit des Vorhandenseins versteckter Funktionen, die während der Entwurfs- oder Entwicklungsphase eingeschleust wurden','Mogelijkheid van het bestaan van verborgen functies ingevoerd tijdens de ontwerp- en ontwikkelingsfase',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc059f-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1210','Absence d\'une politique de durcissement des systèmes','Lack of a system hardening policy','Keine Richtlinien für das Hardening der Systeme','Gebrek aan een beleid voor het versterken van de systemen','Mots de passe ? Comptes par défaut ? Services par défaut ?\nExiste-t-il une procédure de durcissement ? Formelle ?','Passwords? Default accounts? Default services?\nIs there a hardening procedure? Is it formal?','Kennwörter? Standardkonten? Standarddienste?\nGibt es ein Hardening-Verfahren? Formell?','Wachtwoorden? Standaard accounts? Standaard services?\nBestaat er een versterkingsprocedure? Is ze formeel?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc05aa-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1212','Failles dans la gestion ou l\'utilisation dans les comptes à privilèges','Flaws in the management or use of accounts with privileges','Verwaltung oder Nutzung der Konten mit besonderen Berechtigungen weisen Mängel auf.','Zwakke plekken in het beheer of het gebruik van de accounts met bepaalde bevoegdheden','Les comptes à privilèges sont-ils inventoriés ?\nLes mots de passe sont-ils stockés?\nSont-ils revus périodiquement ?\nLes droits sont-ils gérés par profil/fonction de l\'utilisateur ?','Are the accounts with privileges listed?\nAre passwords stored?\nAre they regularly reviewed?\nAre rights managed by user profile/role?','Sind Konten mit besonderen Berechtigungen in einem Verzeichnis erfasst?\nWerden die Kennwörter gespeichert?\nWerden diese regelmäßig überprüft?\nRichten sich die Rechte nach Profil/Funktion des Benutzers?','Worden de accounts met bepaalde bevoegdheden geïnventariseerd?\nWorden de wachtwoorden opgeslagen?\nWorden ze regelmatig herzien?\nWorden de rechten beheerd door het profiel/de functie van de gebruiker?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc05b4-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1213','Présences de lacunes dans la gestion des changements ou la maintenance des logiciels','Problems in change management or software maintenance','Lücken im Change-Management bzw. in der Softwarewartung','Bestaan van lacunes in het beheer van de wijzigingen of het onderhoud van de software','La gestion des changements sur les logiciels ou sur le système d\'information est elle correcte ?\nPlanification des changements ? Estimation des charges ? Tests avant mise en production ?','Is change management for software or the IT system correct?\nIs there planning for changes? \nCost estimates? \nTests before production begins?','Ist das Change-Management für Software bzw. das Informationssystem angemessen?\nPlanung von Änderungen? \nKostenschätzung? \nTests vor Wechsel in die Produktivumgebung?  ','Is het beheer van de wijzigingen aan de software of aan het informatiesysteem correct?\nPlanning van de wijzigingen? Schatting van de belastingen? Tests vóór het in productie brengen?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc05bf-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1214','Absence de contrôle périodique des autorisations d’accès physique','Physical access authorisations are not checked regularly','Keine regelmäßige Kontrolle der Genehmigungen für den physischen Zugang','Gebrek aan een periodieke controle van de fysieke-toegangsbevoegdheden','Les droits d\'accès physiques aux locaux sensibles sont-ils revus périodiquement ?\nUtilisateurs ? Administrateurs ?','Are physical access rights to sensitive premises regularly reviewed?\nUsers? Administrators?','Werden die Rechte für den physischen Zugang zu sensiblen Räumlichkeiten regelmäßig überprüft?\nBenutzer? Administratoren?','Worden de rechten i.v.m. de fysieke toegang tot de lokalen regelmatig herzien?\nGebruikers? Administrators?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc05c9-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1215','Absence de contrôle périodique des autorisations d’accès logique','Logical access authorisations are not checked regularly','Keine regelmäßige Kontrolle der Genehmigungen für den elektronischen Zugang','Gebrek aan een periodieke controle van de logische-toegangsbevoegdheden','Les droits d\'accès logiques sont-ils revus périodiquement ?\nComptes utilisateurs ?\nComptes à privilèges ?','Are logical access rights regularly reviewed?\nUser accounts?\nAccounts with privileges?','Werden die Rechte für den elektronischen Zugang regelmäßig überprüft?\nBenutzerkonten?\nKonten mit besonderen Berechtigungen?','Worden de logische-toegangsrechten regelmatig herzien?\nGebruikersaccounts?\nAccounts met voorrechten?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc05d3-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1216','Absence de vigilance lors d\'une intervention d’un tiers (fournisseur, femme de ménage, etc.)','No supervision of third-party access (supplier, cleaner, etc.)','Keine Beaufsichtigung Dritter bei ihren Einsätzen (Lieferanten, Reinigungskräfte usw.)','Gebrek aan waakzaamheid tijdens een interventie van een derde (leverancier, poetsvrouw enz.)','Est-ce que les personnes normalement non autorisées sont sous surveillance lors d\'intervention exceptionnelle (internes ou externes) ?','Are normally unauthorised persons (internal or external) monitored when given special access?','Stehen (interne oder externe) Personen, die normalerweise nicht befugt sind, bei außerplanmäßigen Einsätzen unter Aufsicht? ','Staan personen die normaal niet bevoegd zijn onder toezicht tijdens een (interne of externe) uitzonderlijke interventie?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc05dd-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1217','Les données de production sont utilisées à des fins de test ou de développement','Production data are used for tests or development','Die Produktivdaten werden für Test- oder Entwicklungszwecke verwendet.','De productiegegevens worden gebruikt voor test- of ontwikkelingsdoeleinden','Les données de production sont elles sensibles ?\nSont-elles utilisées pour les tests ? Détruites après les tests ?\nLes données peuvent-elles être dupliquées ou copiées ?','Are production data sensitive?\nAre they used for tests? Are they destroyed after the tests?\nCan data be duplicated or copied?','Handelt es sich bei den Produktivdaten um sensible Daten?\nWerden diese für die Tests verwendet? Nach den Tests vernichtet?\nKönnen die Daten dupliziert oder kopiert werden?','Zijn de productiegegevens gevoelig?\nWorden ze gebruikt voor tests? Vernietigd na de tests?\nKunnen de gegevens worden gedupliceerd of gekopieerd?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc05e7-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1218','Absence d\'identification des besoins en sécurité','Security requirements are not identified','Sicherheitsbedarf wurde nicht identifiziert','Gebrek aan een identificatie van de veiligheidsbehoeften','Les exigences de sécurités ont elles été spécifiées pour les échanges externes ?\nY a-t-il des informations sensibles ?\nL\'échange d\'information est-il chiffré ou non ?','Have security requirements been set for external exchanges?\nIs there sensitive information?\nIs information exchange encrypted?','Wurden Sicherheitsanforderungen für den externen Datenaustausch festgelegt?\nSind sensible Informationen vorhanden?\nWird der Informationsaustausch verschlüsselt oder nicht?','Werden de veiligheidseisen gespecificeerd voor externe uitwisselingen?\nIs er gevoelige informatie?\nIs de informatie-uitwisseling gecodeerd of niet?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc05f1-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1219','Absence de cloisonnement entre les environnements de développements et d\'exploitation','No separation of development and operating environments','Keine Trennung zwischen Entwicklungs- und Produktivumgebungen','Gebrek aan een scheiding tussen de ontwikkelings- en de exploitatieomgevingen','Les environnements de développement sont-ils séparés ?\nQuelles sont les contraintes de passage d\'un à l\'autre ?\nQuelle méthodologie de développement est utilisée ?','Are the development environments separate?\nWhat are the constraints for moving from one to the other?\nWhich development method is used?','Sind die Entwicklungsumgebungen voneinander getrennt?\nWelche Beschränkungen gibt es für die Übertragung von einer zur anderen?\nWelche Entwicklungsmethodik wird angewendet?','Zijn de ontwikkelingsomgevingen gescheiden?\nWat zijn de eisen om van de ene naar de andere over te gaan?\nWelke ontwikkelingsmethodologie wordt er gebruikt?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0607-4591-11e9-9173-0800277f0571',@max_anr_id,0,'122','Possibilité d\'amorcer plusieurs systèmes d\'exploitation sur la même machine (ex.: accès aux partitions NTFS via Linux)','Possibility of booting several operating systems on the same machine (e.g. access to NTFS partitions via Linux)','Möglichkeit, mehrere Betriebssysteme auf dem gleichen Rechner zu betreiben (z. B. Zugang zu NTFS-Partitionen via Linux)','Mogelijkheid om meerdere besturingssystemen te starten op dezelfde machine (bv.: toegang tot NTFS-partities via Linux)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0612-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1220','Absence de protection d\'informations secrètes d\'authentification','No protection of confidential authentication information','Kein Schutz geheimer Authentifizierungsdaten','Gebrek aan een beveiliging van geheime authenticatiegegevens','Vérifier la gestion des moyens d\'authentification tels que : Identifient, mot de passe, Token, Smartcard, Tancard, etc.','Verify authentication method management such as: ID, password, Token, Smartcard, TAN card, etc.','Überprüfung der Verwaltung der Authentifizierungsmittel, wie unter anderem: Benutzername, Kennwort, Token, Smartcard, Tancard usw.','Verifiëren van het beheer van de authenticatiemiddelen zoals: identifier, wachtwoord, token, smartcard, tancard enz.',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc061d-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1221','Les droits de l\'utilisateur permettent l’export de l\'information','User rights allow information to be exported','Die Rechte des Benutzers erlauben den Export von Informationen.','De rechten van de gebruiker maken het exporteren van informatie mogelijk','Y a-t-il possibilité d\'exporter les données ?\nÉgalement en format structuré (XLS, CSV, XML, etc.) ?','Can data be exported?\nAlso in a structured format (XLS, CSV, XML, etc.)?','Gibt es die Möglichkeit, die Daten zu exportieren?\nAuch in strukturiertem Format (XLS, CSV, XML usw.)? ','Is er een mogelijkheid om de gegevens te exporteren?\nOok in een gestructureerd formaat (XLS, CSV, XML enz.)?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0627-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1224','La télémaintenance n\'est pas gérée correctement par le fournisseur','The supplier does not manage remote maintenance properly','Die Fernwartung wird vom Anbieter nicht korrekt ausgeführt.','Het onderhoud op afstand wordt niet correct beheerd door de leverancier','Liaison maintenue en permanence\nÉchanges en clair \nAbsence de compte-rendu','Link permanently maintained\nUnencrypted exchanges\nNo record','Ständige Verbindung\nUnverschlüsselter Austausch \nKein Protokoll','Permanent onderhouden verbinding\nOngecodeerde uitwisselingen\nGebrek aan een verslag',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0631-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1225','Les identifiants et mots de passe d’authentification par défaut ne sont pas modifiés après installation des systèmes','Default authentication IDs and passwords are not changed after system installation','Die standardmäßigen Benutzernamen und Authentifizierungskennwörter werden nach Installation der Systeme nicht geändert.','De standaard identifiers en authenticatiewachtwoorden worden niet gewijzigd na het installeren van de systemen','Où sont-ils stockés ?\nEst-ce qu\'ils sont changés périodiquement ?','Where are they stored?\nAre they changed regularly?','Wo werden sie gespeichert?\nWerden sie in regelmäßigen Abständen geändert?','Waar worden ze opgeslagen?\nWorden ze regelmatig gewijzigd?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc063b-4591-11e9-9173-0800277f0571',@max_anr_id,0,'1226','Absence de coordination entre services concernés avant l\'embauche et lors de la modification du contrat','No coordination between the departments concerned before hiring staff and when contracts are modified','Keine Koordination zwischen den betreffenden Abteilungen vor der Einstellung von Mitarbeitern und bei Vertragsänderungen','Gebrek aan coördinatie tussen de betrokken diensten vóór de indienstneming en tijdens de wijziging van het contract','Embauche, changement de service, arrêt contrat \nRetrait des droits physique \nRetrait des droits logique \nRestitution du matériel \nEst-ce une procédure formelle ?','Hiring, changing department, contract termination\nRemoval of physical rights\nRemoval of logical rights\nReturn of hardware\nIs there a formal procedure?','Einstellung von Mitarbeitern, Abteilungswechsel, Vertragsende \nEntzug der physischen Rechte \nEntzug der elektronischen Rechte \nRückgabe der Hardware \nGibt es ein formelles Verfahren?','Indienstneming, verandering van dienst, einde contract \nIntrekking van de fysieke rechten\nIntrekking van de logische rechten\nTeruggave van de hardware\nIs er een formele procedure?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0645-4591-11e9-9173-0800277f0571',@max_anr_id,0,'123','Utilisation non intuitive du logiciel','Non-intuitive software','Keine intuitive Benutzung der Software','Niet-intuïtief gebruik van de software',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0650-4591-11e9-9173-0800277f0571',@max_anr_id,0,'124','Insuffisance de compétence','Insufficient competency','Fehlender Sachverstand','Gebrek aan kennis',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
