('69fc072f-4591-11e9-9173-0800277f0571',@max_anr_id,0,'127','Fichiers d\'imputation complexes ou peu ergonomiques','Assignment files too complex or unpractical','Komplexe bzw. wenig ergonomische Dateien','Complexe of niet bijzonder ergonomische boekingsbestanden',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc073a-4591-11e9-9173-0800277f0571',@max_anr_id,0,'13','Absence de filtre protégeant le système contre un engorgement','No filter to protect the system against saturation','Fehlender Filter zum Schutz des Systems gegen Überlauf','Gebrek aan een filter die het systeem beschermt tegen congesties',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0745-4591-11e9-9173-0800277f0571',@max_anr_id,0,'130','La base de mots de passe du système d\'exploitation est déchiffrable','The password base of the operating system is decipherable','Die Passwörter-Datenbank des Betriebssystems ist entschlüsselbar','De wachtwoordendatabase van het besturingssysteem is decodeerbaar',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc074f-4591-11e9-9173-0800277f0571',@max_anr_id,0,'132','Possibilité que le système d\'exploitation soit soumit à des requêtes ou données mal formées (ex.: buffer overflow)','Possibility of the operating system being subjected to badly formed requests and data (e.g. buffer overflow)','Möglicherweise wird das Betriebssystem mit unkorrekten Anfragen bzw. Daten konfrontiert (z. B. Buffer overflow)','Mogelijkheid dat het besturingssysteem wordt blootgesteld aan slecht gevormde query’s of gegevens (bv.: buffer overflow)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
