('69fc0764-4591-11e9-9173-0800277f0571',@max_anr_id,0,'137','Le système d\'exploitation est accessible et utilisable par tous (ex.: connexion sur le compte \"invité\")','The operating system can be accessed and used by everyone (e.g. connection via the guest account)','Das Betriebssystem ist allgemein zugänglich und von jedermann benutzbar (z. B. über das Konto \"Gast\")','Het besturingssysteem is voor iedereen toegankelijk en bruikbaar (bv.: verbinding via de account “gast”)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc076f-4591-11e9-9173-0800277f0571',@max_anr_id,0,'138','Le système d\'exploitation ne journalise pas les logs ou les événements système','The operating system does not log system records or events','Das Betriebssystem protokolliert keine Logs oder Systemereignisse','Het besturingssysteem logt de logs of de systeemgebeurtenissen niet',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc0779-4591-11e9-9173-0800277f0571',@max_anr_id,0,'139','Le système d\'exploitation permet l\'établissement de connexions anonymes','The operating system can be used to make anonymous connections','Das Betriebssystem ermöglicht die Herstellung anonymer Verbindungen','Het besturingssysteem maakt het mogelijk anonieme verbindingen tot stand te brengen',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
