('69fc079a-4591-11e9-9173-0800277f0571',@max_anr_id,0,'140','Le système d\'exploitation permet l\'ouverture de session sans mot de passe','The operating system allows a session to be opened without password','Das Betriebssystem ermöglicht das öffnen einer Session ohne Passwort','Het besturingssysteem maakt het mogelijk sessies te openen zonder wachtwoord',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc07a5-4591-11e9-9173-0800277f0571',@max_anr_id,0,'143','Les mots de passe saisis pour accéder au système d\'exploitation sont déchiffrables','The passwords entered for access to the operating system are decipherable','Die Passwörter zum Zugang zum Betriebssystem sind entschlüsselbar','De ingevoerde wachtwoorden om toegang te krijgen tot het besturingssysteem zijn decodeerbaar',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc07b1-4591-11e9-9173-0800277f0571',@max_anr_id,0,'15','Application nécessitant des ressources informatiques non adaptée au matériel (ex.: manque de mémoire vive)','Application requiring computing resources not matched by the equipment (e.g. insufficient RAM)','Anwendung erfordert IT-Ressourcen, die der Hardware nicht angepasst ist (z. B. unzureichender Arbeitsspeicher)','Applicatie die informaticamiddelen vereist die niet zijn aangepast aan de hardware (bv.: te weinig werkgeheugen)',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
('69fc07bc-4591-11e9-9173-0800277f0571',@max_anr_id,0,'16','Absence de prise en compte dans la définition des exigences d\'un projet des situations particulières plaçant le système dans des conditions aux limites','Requirements defined for a project without taking into account special situations that put the system under limit conditions.','Bei Definition der Projektanforderungen fehlende Berücksichtigung von Ausnahmesituationen, bei denen das System die Grenzbedingungen erreicht','Geen rekening houden in de definitie van de eisen van een project met bijzondere situaties die het systeem in omstandigheden met beperkingen kunnen brengen',NULL,NULL,NULL,NULL,1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
