('69fc0948-4591-11e9-9173-0800277f0571',@max_anr_id,0,'21','Absence de procédure de maintenance','No maintenance procedure','Fehlende Wartungsprozedur','Gebrek aan een onderhoudsprocedure','Y a-t-il une procédure de maintenance ?\nLe personnel est-il interne ou externe ?\nEst-il supervisé pendant son intervention ?\nPrésence de contrats ? Présence de NDA ?','Is there a maintenance procedure?\nAre the staff members internal or external?\nAre they supervised while working?\nAre there contracts? Is there an NDA?','Gibt es ein Wartungsverfahren?\nHandelt es sich bei dem Personal um internes oder externes Personal?\nFührt es seine Tätigkeit unter Aufsicht aus?\nGibt es Verträge? Gibt es eine Vertraulichkeitsvereinbarung?','Bestaat er een onderhoudsprocedure?\nIs het personeel intern of extern?\nWordt het gesuperviseerd tijdens zijn interventies?\nAanwezigheid van contracten? Aanwezigheid van NDA?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
