('69fc2b26-4591-11e9-9173-0800277f0571',@max_anr_id,0,'981','Le réseau facilite l\'utilisation des ressources par des personnes non autorisées','The network makes it easy for unauthorised persons to use the resources','Das Netzwerk vereinfacht die Nutzung von Ressourcen durch Unbefugte','Het netwerk vergemakkelijkt het gebruik van de middelen door onbevoegde personen','Le réseau est-il segmenté ?\nLe réseau est-il chiffré ?\nEst-il possible de se connecter sur le réseau filaire par des boîtiers isolés ?','Is the network segmented?\nIs the network encrypted?\nIs it possible to connect to the wired network through insulated casings?','Ist das Netzwerk segmentiert?\nIst das Netzwerk verschlüsselt?\nKann man sich im kabelgebundenen Netzwerk über Standalone-Boxen anmelden?','Is het netwerk gesegmenteerd?\nIs het netwerk gecodeerd?\nIs het mogelijk een verbinding te maken met het kabelnetwerk via geïsoleerde dozen?',1,'Admin Admin','2020-05-15 16:05:54',NULL,NULL),
